INSERT INTO `abouts` (`id`, `title`, `desc`, `created_at`, `updated_at`) VALUES
(1, '<p>WHO WE ARE&nbsp;&amp;&nbsp;WHAT WE DO?</p>', '<p>The <strong>SAMA</strong> Company was founded in <strong>1978 </strong>and is involved in providing packaging machines and product processing systems. We provide the full range of products and services that our customers need to achieve quality standards in the market. Sama has a substantial reputation for not only manufacturing high quality Machines and Processing Systems but also delivering reliability, service, and excellent value for money. We provide complete solution with consultancy and automatization with brilliant after sales services and spare parts availability (3S). Sama Engineering is in direct contact with 300 local companies including Private, Public Limited, International, &amp; Multinational Organizations.<br /><br />Flexible packaging is becoming more and more popular due to its multiple advantages over other types of materials. This can be clearly noticed in some sectors such as food and beverage, pharmaceutical, cosmetic, health and personal care amongst others where flexible packs are gradually replacing traditional presentations like bottles, tins or other rigid containers. The Solution is set according to the product and the packaging material of the customer.</p>', '2019-02-19 07:30:16', '2019-05-30 15:39:25');
