(10, 'sample', 'sample', 4, '<p>Test</p>', 'hjbhjb', '5c7c0594d7080sama-engineering-is-participating-in-lahore-expo-center-pakistan.jpg', 1, 1, 0, 'https://www.youtube.com/embed/j_53zWLVv4I', '2019-03-03 08:49:24', '2019-03-27 02:17:09'),
(11, 'Sama Engineering is Participating in Lahore Expo Center, Pakistan.', 'sama-engineering-is-participating-in-lahore-expo-center-pakistan', 8, '<p><a href=\"http://www.samaengineering.com/\">SamaEngineering</a>, a leading&nbsp;<a href=\"http://www.samaengineering.com/\">packaging machines</a>&nbsp;manufacturer participating in Exhibition, taking place at Lahore Expo Center from 18th to 20th August, 2016, managed by Pegasus Consultancy pvt ltd., organised by Plasti &amp; Pack.</p>\r\n\r\n<p>The SAMA Company was founded in 1978 and is involved in providing packaging machines and product processing systems. It provides the full range of products and services that customers need, to achieve quality standards in market. Sama has substantial reputation for not only manufacturing high quality&nbsp;<a href=\"http://www.samaengineering.com/\">Machines and Processing Systems</a>&nbsp;but also delivering reliability, service, and excellent value for money.</p>\r\n\r\n<p>We welcome all the businessmen and people who are related to the industry to visit and get the most recent updates about the machineries and product processing systems.</p>\r\n\r\n<p><strong>Address</strong>:<br />\r\n+92 (21) 36688883<br />\r\n+92 (21) 36603311<br />\r\ninfo@samaengineering.com<br />\r\nsales@samaengineering.com<br />\r\nNazimabad # 2, Block-A, Plot No. 1/32, Opposite Firdous Colony KHI-74600 Pakistan</p>', 'SamaEngineering, a leading packaging machines manufacturer participating in Exhibition', '5c9a96a5260e1sama-engineering-is-participating-in-lahore-expo-center-pakistan.jpg', 1, 0, 0, NULL, '2019-03-26 13:16:21', '2019-03-27 02:17:09'),
(12, 'Polymer & Packaging International Magazine: Reports Today About Eminence Of SamaEngineering', 'polymer-packaging-international-magazine-reports-today-about-eminence-of-samaengineering', 8, '<p><strong>&ldquo;Entering the picture and getting prominent by achievements&rdquo;</strong></p>\r\n\r\n<p><a href=\"http://www.polymerandpackaging.com/\">Polymer and packaging</a>&nbsp;the famous magazine and information source for the plastic &amp; packaging industry, has emerged to be one of the successful news for innovations taking place in international plastic and packaging companies. Sama engineering is the manufacturer of bakery machines &amp; equipment, packaging machines and processing systems, stands first in Pakistan, growing continuously in extensive fields to serve diversified businesses with quality machines. As reported in Polymer and packaging international magazine in its 4th&nbsp;volume, 2nd&nbsp;issue.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>&ldquo;We&rsquo;re striving to bring new &amp; customized long-lasting automatic machines, for organizations to enable them, serve in standardized hygienic products throughout the world.&rdquo; &ndash; Mr Shahzad Sama, Managing Partner Of&nbsp;</em></strong><a href=\"http://www.samaengineering.com/\"><strong><em>SamaEngineering</em></strong></a><strong><em>.</em></strong></p>', 'Polymer & Packaging International Magazine: Reports Today About Eminence Of SamaEngineering', '5c9a98adee0e2polymer-packaging-international-magazine-reports-today-about-eminence-of-samaengineering1.jpg', 1, 0, 0, NULL, '2019-03-26 13:25:01', '2019-03-27 02:17:09'),
(13, 'Sama Engineering Participating – Lahore Exhibition 2016', 'sama-engineering-participating-lahore-exhibition-2016', 8, '<h3><strong>Sama Engineering Participating &ndash;</strong>&nbsp;<em>Lahore Exhibition 2016</em></h3>\r\n\r\n<p>International Plasti&amp;Pack By Pegasus</p>\r\n\r\n<p>This year once again,&nbsp;<a href=\"http://samaengineering.com/\">SAMA Engineering</a>, the Asian multinational packaging machines and processing systems manufacturer, is making its presence felt in the sector&rsquo;s largest exhibition fair worldwide, showcasing its high quality, innovative design and long-lasting products while promoting its brand name and securing a larger share of the international market.</p>\r\n\r\n<p><strong>Sama Engineering</strong>, the packaging machines, bakery items and food processing systems manufacturing company is participating in&nbsp;<strong>Lahore Exhibition</strong>&nbsp;18th&nbsp;August 2016 till 20th August 2016. It&rsquo;s an international event where more than 400 companies participating from 30 countries worldwide. This event has enabled companies to introduce latest technologies of packaging, food and printing industries.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The event is organized by&nbsp;<strong>PEGASUS</strong>&nbsp;group, which has been launched by&nbsp;<a href=\"http://www.plastipacpakistan.com/\">Plati&amp;Pack</a>.&nbsp;<strong>Sama Engineering</strong> is the leading firm of Pakistan in plastic and packaging industry is presenting the competitive methods and technology.</p>', 'Sama Engineering Participating – Lahore Exhibition 2016', '5c9a994964824sama-engineering-participating-lahore-exhibition-2016.jpg', 1, 1, 0, 'https://www.youtube.com/watch?v=Lg2FuOD93-4&feature=youtu.be', '2019-03-26 13:27:37', '2019-03-27 02:17:09'),
(14, 'Pharmaceutical Industry: Medicines Safe Packing', 'pharmaceutical-industry-medicines-safe-packing', 10, '<p>Pharmaceutical industry being responsible for supplying medicines safely to patients, doctors, hospitals, nurses and others, are more concerned about effective packaging systems. Packaging for Pharma companies is somehow different than other industries, as they are known to be delivering protection, security and comfort to the patients. Innovations are constantly taking place as the packaging of medicines ranges from blow fill seal, syringes pre-filled and sealed, two in one prefilled items, child-resistant packets and snap off ampoules etc. A disciplined packaging has to protect the powder, solid, liquid or any type of drug from an external environment and protect the material&rsquo;s potency. An efficient&nbsp;<strong>packaging machine</strong>&nbsp;can ensure the proper and accurate dosage with an international standardized form of covering or wrapping items in bottles, sachets, vials tubes, bags, and ampoules and so on. Pharmaceutical companies render their services to earn trust from end users of medicines with the help of fine packaging and keeping themselves transparent.</p>\r\n\r\n<p>Sama Engineering deals with the trust built by Pharma companies and complies with ethical rules of satisfying users of medicines. We manufacture innovative pharmaceutical packaging machines to help build a good company image in international markets. We provide speedy, cost-effective and time-saving setup is necessary to cope up with national and international demand.</p>\r\n\r\n<p>&nbsp;</p>', 'Pharmaceutical Industry: Medicines Safe Packing', '5c9a99bfc7106pharmaceutical-industry-medicines-safe-packing.jpg', 1, 1, 0, NULL, '2019-03-26 13:29:35', '2019-03-27 02:17:09'),
(15, 'Shah Sama – A Successful Businessman', 'shah-sama-a-successful-businessman', 8, '<p>&nbsp;</p>\r\n\r\n<p>Shah Sama, an&nbsp;<a href=\"http://shahsama.com/\">entrepreneur</a>, built his personality as a&nbsp;<a href=\"http://shahsama.com/\">businessman&nbsp;</a>with own passion, ideas and willingness to gain experience in the mortal world to remain alive ever. He started his professional career by joining Sama Engineering as a director and put forth his ideas to get the organization towards the path of success, modernization and building its brand image. After successful achievement in Sama engineering&rsquo;s goals, he launched another platform for businesses to gain benefits in virtual terms.</p>\r\n\r\n<p>Minibig technologies, a software house and a digital media agency, introduced and established by&nbsp;<a href=\"http://shahsama.com/\">Shah Sama</a>, started its journey by entertaining many small, medium and large organizations in capturing the digital world and having fruits in the form of clients and profits. While with the marketing, SEO and other digital techniques MBT earned a status, Shah Sama added Burkahost.com, a new project to provide the clients with a safe and secure place for domains and web hosting throughout the Middle East. Depending on current political and market situations, the need for a virtual market arose, wisely taking it as an opportunity, he worked on an idea of launching an E-commerce website as a new vast project of Minibig technologies.</p>\r\n\r\n<p>Endless ideas, full dedication and enthusiastic nature, drives him to research on needs and convert them to profitable opportunities.</p>\r\n\r\n<p><em><strong>Experience builds a door and success keeps on knocking it</strong></em>.<br />\r\n&ldquo;Shah Sama&rdquo;</p>\r\n\r\n<p>&nbsp;</p>', 'Experience builds a door and success keeps on knocking it.', '5c9a9a371620fshah-sama-successful-entrepreneur.jpg', 1, 1, 0, NULL, '2019-03-26 13:31:35', '2019-03-27 02:17:09'),
(16, 'Automated Bakery Items Making Machines By Sama Engineering', 'automated-bakery-items-making-machines-by-sama-engineering', 11, '<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://www.samaengineering.com/\"><strong>Sama engineering</strong></a>, the KCCI award-winning, largest exporter of Pakistan has a range of bakery items making machines and processing systems with efficient and effective capabilities ensuring high standards of performance in bakery stuff. Most of the people frequently find health issues using bakery items made by human hands and they trust brands to provide high-quality sweets, bread and breakfast items. We fulfil consumer expectations by providing such bakery machines that make halwa, sweets, nimko, ice creams, bread etc. in an organic and neat manner to serve the society natural preserved tastes as promised by brands. We help brands and companies keeping this trust alive; serving consumers with healthy sweets and breakfast items through well-managed bakery machines. Sama engineering is serving businesses, companies and different firms for several years in machine manufacturing, throughout the Middle East and Asia. Most of the delighted clients are found in Saudi Arabia, Qatar, Bahrain, Bangladesh and Pakistan. We are a leading packaging machines and processing systems manufacturing company in an agro-based economy, engaged in making machines that meet European standards. We are adaptive to meet the current requirements of society and creative enough to bring the societies up to international levels.</p>\r\n\r\n<p>Series of bakery machines, introduced by Sama engineering include Dough divider rounder machine, halwa making machine, laddu processing machine or laddu making system, namkeen making machine, bread slicer, Dough divider rounder, dough divider rounder Spiral machine, planetary mixer machine to make ice creams, Electric rotary Rack oven to fulfil all baking needs, Halwa machine/Halwa making machine, ganthiya making machine, nimko making machines and Gulab Jaman machine. Sustainable, fast and neat machines that ensure healthy hygiene food to societies. These all machines of bakery series enables bakeries to care about the emotions of consumers.</p>', 'Automated Bakery Items Making Machines By Sama Engineering', '5c9a9ad88b0afautomated-bakery-items-making-machines-sama-engineering.jpg', 1, 1, 0, NULL, '2019-03-26 13:34:16', '2019-03-27 02:17:09'),
(17, 'Toasting, Drying and Expanding Snacks Processing Systems by Sama Engineering', 'toasting-drying-and-expanding-snacks-processing-systems-by-sama-engineering', 11, '<p>Chips and snacks are not foods but a meal of refreshment and joy for consumers. Snacks being consumed highly is available in huge verities. Brands strive to provide consumers with the best quality snacks that contain natural taste and proper ingredients. Consumers are sometimes not entertained properly due to processing errors of chips and snacks. Cutting, slicing, heating, frying and ingredients combination or mixing, mostly cause tasteless, burnt and of the shape snacks. While preferring any branded snacks over unbranded, consumers expect higher quality and tasty snacks. Sama Engineering provides brands, a complete processing system that can meet customer requirements in a very professional way to give valuable chips/snacks to spend money on. Snacks processing machines are designed with a proper concentration on managed systems and timers to keep snacks in the proper size, fresh, tasty and no extra mixtures or ingredients on it. Wetting till continuous fryer, every step keeps material on a level that can be trusted by clients for normal usage, events or parties.</p>\r\n\r\n<p>Processing systems of&nbsp;<strong><a href=\"http://www.samaengineering.com/\" target=\"_blank\">Sama Engineering</a></strong>&nbsp;start with material screening to ensure snacks does not contain any extra or rough items. The second step is the wetting process in a suitable quantity and method. The third step of snacks processing system helps in slicing and cutting the material equally to give it a beautiful look. The fourth step has a machine to dry in predefined heat and speed. Finally, chips are fried and flavored. Machines of Sama Engineering involved in the process include material screening machine, material wetting machine, extrusions, cutting machine, drying machine, frying and flavoring machine.</p>\r\n\r\n<p>Sama engineering is serving businesses, companies, and different firms for several years in machine manufacturing, throughout the Middle East and Asia. Most of the delighted clients are found in Saudi Arabia, Qatar, Bahrain, Bangladesh, and Pakistan. We are a leading packaging machines and&nbsp;<a href=\"http://www.samaengineering.com/\" target=\"_blank\">processing systems</a>&nbsp;manufacturing company in an agro-based economy, engaged in making machines that meet European standards. We are adaptive to meet the current requirements of society and creative enough to bring the societies up to international levels.</p>', 'Toasting, Drying and Expanding Snacks Processing Systems by Sama Engineering', '5c9b0e84a73ectoasting-drying-expanding-snacks-processing-systems-sama-engineering.jpg', 1, 0, 0, NULL, '2019-03-26 21:47:48', '2019-03-27 02:17:09'),
(18, 'Pharmaceutical Industry Getting More Conscious About Safety', 'pharmaceutical-industry-getting-more-conscious-about-safety', 10, '<p><a href=\"http://www.samaengineering.com/\" target=\"_blank\">Pharmaceutical industry</a>&nbsp;being responsible for supplying medicines safely to patients, doctors, hospitals, nurses and others, are more concerned about effective packaging systems. Packaging for Pharma companies is somehow different than other industries, as they are known to be delivering protection, security, and comfort to the patients. Innovations are constantly taking place as the packaging of medicines ranges from blow fill seal, syringes pre-filled and sealed, two in one prefilled items, child-resistant packets and snap off ampoules etc. A disciplined packaging has to protect the powder, solid, liquid or any type of drug from an external environment and protect the material&rsquo;s potency. An efficient packaging machine can ensure the proper and accurate dosage with an international standardized form of covering or wrapping items in bottles, sachets, vials tubes, bags, and ampoules and so on. Pharmaceutical companies render their services to earn trust from end users of medicines with the help of fine packaging and keeping themselves transparent.</p>\r\n\r\n<p><strong><a href=\"http://www.samaengineering.com/\" target=\"_blank\">Sama Engineering</a></strong>&nbsp;deals with the trust built by Pharma companies and complies with ethical rules of satisfying users of medicines. We manufacture innovative pharmaceutical packaging machines to help build a good company image in international markets. We provide speedy, cost-effective and time-saving setup is necessary to cope up with national and international demand.</p>', 'Pharmaceutical Industry Getting More Conscious About Safety', '5c9b0edfc0716pharmaceutical-industry-getting-conscious-safety.jpg', 1, 0, 0, NULL, '2019-03-26 21:49:19', '2019-03-27 02:17:09'),
(19, 'Interview with Business Help Line Fortnightly', 'interview-with-business-help-line-fortnightly', 8, '<p>Being a leading company of Pakistan in&nbsp;<a href=\"http://www.samaengineering.com/\">Packaging Machines</a>&nbsp;industry,&nbsp;<strong>Sama Engineering</strong>&nbsp;is heading towards an aim to revolutionize the business structure in a developing nation by making official discussions and keeping problems faced by all industries, in front of journalists. Having an interview regarding business with Business Help Line Newspaper (<a href=\"http://www.facebook.com/Business-Helpline-Fortnightly-Newspaper-Karachi-792273514151935\">BHL</a>),&nbsp;<a href=\"http://www.samaengineering.com/\">Sama Engineering</a>&rsquo;s M.D put forth major hurdles that must be controlled by the Government of Pakistan in order to maintain ongoing upcoming businesses. Issues that were stressed repeatedly includes taxation management, power supply, and exchange rates. These issues damage the financial and operational health of companies are found frequent indicators in Pakistan.</p>', 'Interview with Business Help Line Fortnightly', '5c9b0f5189737interview-business-helpline.jpg', 1, 0, 0, NULL, '2019-03-26 21:51:13', '2019-03-27 02:17:09');
