(20, 'TP – 150-C Horizontal Single Dates Packaging Machine', 'tp-150-c-horizontal-single-dates-packaging-machine', 12, '<h2><strong>TP &ndash; 150-C Horizontal Single Dates Packaging Machine</strong></h2>\r\n\r\n<p><em><strong>For buy this Machine</strong>&nbsp;<a href=\"http://www.samaengineering.com/contactus\">Contact Us</a><a name=\"_Toc470709253\"></a></em></p>\r\n\r\n<p>TP &ndash; 150 Model of Sama engineering packaging machine has a wide range of sub-models that are used in the packaging of a single item. That item is not limited to any single category of product. TP-150 series of the model can be used for tea, buns, chocolates, soaps, biscuits, rusk, single dates packaging, sweets, candies, tennis balls, tea bundles, tea bags and tea packs packaging, razor packing, indicator, cream outer packaging and so on. All these types of products have the further capability to be packed in different sizes as well as formats.</p>\r\n\r\n<h3><strong>Salient Features:</strong></h3>\r\n\r\n<table border=\"1\" cellspacing=\"0\" style=\"width:7.25in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.55in\">\r\n			<p>Single Date Packaging horizontal machine</p>\r\n			</td>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.6in\">\r\n			<p>Custom Size Pillow format, gusset and Center Seal bag</p>\r\n			</td>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.95in\">\r\n			<p>Imported Parts from reliable supplier countries</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.55in\">\r\n			<p>Makes bags, fill and seal</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.6in\">\r\n			<p>Pack up to 250 BPM</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.95in\">\r\n			<p>Nitrogen Filling to keep food fresh</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.55in\">\r\n			<p>Single bag cut</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.6in\">\r\n			<p>Counter meter available</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.95in\">\r\n			<p>Safe and hazard free</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.55in\">\r\n			<p>Chain of bags cut</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.6in\">\r\n			<p>Custom Reel Width</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.95in\">\r\n			<p>Hygiene approved medically</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.55in\">\r\n			<p>Photoelectric Sensors</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.6in\">\r\n			<p>User-Friendly Interface</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.95in\">\r\n			<p>CE certified</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><a name=\"_Toc470709254\"></a><strong>About Single&nbsp;<strong>Dates Packaging Machine</strong>&nbsp;TP-150 C:</strong></h3>\r\n\r\n<p>TP-150 C is designed to fulfill the dates of packaging needs. It automatically measures the size, makes bags, does the filling of dates in bags and seals the bags itself. It has the ability to cut the single bag or keep it in chained with packed bags and cut after the required number of bags in the chain. This is done by a reliable photoelectric detecting system.</p>\r\n\r\n<h3><a name=\"_Toc470709255\"></a><strong>Formats And Sizes Of Bags:</strong></h3>\r\n\r\n<p>The packaging of dates is in small bag or pillow form which can be changed as per requirement in other formats including, gusset bag and center seal bags. Dates can be packed with TP-150 c in different sizes of bags easily.</p>\r\n\r\n<h3><a name=\"_Toc470709256\"></a><strong>Specification:</strong></h3>\r\n\r\n<p><strong>Single date packing machine</strong>&nbsp;is in horizontal form. It has the ability to pack up to 250 BPM (bags per minute) consequently, many dates per minute are packed in small sachets. The machine operator can easily change bag size. Reel width has no limit, custom solutions are available for every customer. It has a counter meter as well as the photoelectric sensor. It consumes lower energy and based on European standards. The user-friendly machine does not require training an operator for a longer time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://www.polymerandpackaging.com/\">Polymer and packaging</a>&nbsp;the famous magazine and information source for the plastic &amp; packaging industry, has emerged to be one of the successful news for innovations taking place in international plastic and packaging companies. Sama engineering is the manufacturer of bakery machines &amp; equipment, packaging machines and processing systems, stands first in Pakistan, growing continuously in extensive fields to serve diversified businesses with quality machines. As reported in Polymer and packaging international magazine in its 4th&nbsp;volume, 2nd&nbsp;issue.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;We&rsquo;re striving to bring new &amp; customized long-lasting automatic machines, for organizations to enable them, serve in standardized hygienic products throughout the world.&rdquo; &ndash; Mr. Shahzad Sama, Managing Partner Of&nbsp;<a href=\"http://www.samaengineering.com/\">S</a>AMA Engineering.</p>\r\n\r\n<h3><strong>Parts Used In Machine:</strong></h3>\r\n\r\n<p>TP-150 C is designed to meet international standards by using parts of reliable supplier countries including, Japan, Korea, Germany, Taiwan, France, and Italy. Sama engineering keeps on switching the suppliers of parts to keep the quality maintained.</p>\r\n\r\n<p><img alt=\"TP – 150-C Horizontal Single Date Packaging Machine\" src=\"data:image/jpeg;base64,\" style=\"height:756px; width:751px\" /><a name=\"_Toc470709258\"></a></p>\r\n\r\n<h3><strong>Benefits:</strong></h3>\r\n\r\n<p>This machine is safe and hazards free with user-friendly process &amp; digital system. It makes finished items in a speedy and efficient manner. A hygiene method of packing dates with easy to clean surface. It uses servo-driven technology. Tower light is installed in the machine to keep the machine user-friendly. As it is a machine, it saves time and wastage of materials. Many dates to fulfill market demand can be packed within an hour without any interruption.</p>\r\n\r\n<p><strong>Dates packaging machine</strong>&nbsp;is durable, made by using&nbsp;<strong>GMP</strong>&nbsp;(General Manufacturing Practices). The packaging of dates by this machine increases the shelf life of dates and keep dates fresh in packets. This machine is suitable to pack food items as it is hygiene and approved medically. An additional benefit is nitrogen filling that can increase the shelf life by keeping food items fresh after packaging.</p>\r\n\r\n<h3><a name=\"_Toc470709259\"></a><strong>CE Certification:</strong></h3>\r\n\r\n<p>CE stands for European conformity. CE certified products are declared to be safe, secure and unhazardous. Those products meet European health and protection legislation. Sama Engineering&rsquo;s single date packing machine is CE certified. Amongst all packaging machines manufacturers of Pakistan, only Sama engineering has CE certification.</p>\r\n\r\n<p>Here Is Horizontal Dates Packaging Machine &ndash; TP &ndash; 150-C&nbsp;Video Via&nbsp;<strong>YouTube</strong></p>\r\n\r\n<p>&nbsp;</p>', 'TP – 150-C Horizontal Single Dates Packaging Machine', '5c9b1219f0e5456088933_6117706179066_3932702021651529728_n.png', 1, 0, 0, 'https://youtu.be/SAoVWEsOixc', '2019-03-26 22:03:05', '2019-03-27 02:17:10');
