color:#ededed; width:1.55in\">\r\n			<p>Single Bag/Pouch Cut</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.6in\">\r\n			<p>Counter Meter Available</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.95in\">\r\n			<p>Safe And Hazard Free</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.55in\">\r\n			<p>Chain Of Bag/Pouch Cut</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.6in\">\r\n			<p>Custom Reel Width</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.95in\">\r\n			<p>Hygiene, Approved Medically</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.55in\">\r\n			<p>Zigzag Cutting Style</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.6in\">\r\n			<p>14 Multi-Head Weightier</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.95in\">\r\n			<p>Auto Alarms When Film Ends</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.55in\">\r\n			<p>Portable &ndash; Throw Caster Wheels</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.6in\">\r\n			<p>Film Sealable On Heat</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.95in\">\r\n			<p>Consumes Lower Electricity</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white; border-color:#ededed; width:1.55in\">\r\n			<p>Photoelectric Sensors</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.6in\">\r\n			<p>User Friendly Interface</p>\r\n			</td>\r\n			<td style=\"background-color:white; width:1.95in\">\r\n			<p>CE Certified</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>About Multiple Dates Packaging Machine SUS-101-MHW (VFFS)</strong></h3>\r\n\r\n<p>SUS-101-MHW (VFFS) is designed to fulfill&nbsp;<strong>dates packaging</strong>&nbsp;needs in pouch format. It is suitable for those companies that offer kg wise pouches of dates. It automatically measures the size, makes bags, does filling of dates in bags and seals the bags itself. It has ability to cut the single bag or keep it in chained with packed bags and cut after required number of bags in chain. This is done by reliable photoelectric detecting system. It works faster and keeps the manufacturing area clean with zero wastage.</p>\r\n\r\n<h3><strong>Formats and sizes of bags</strong></h3>\r\n\r\n<p><strong>Packaging of dates</strong>&nbsp;is in bag, pillow form which can be changed as per requirement in other formats including, gusset bag and center seal bags. Dates can be packed horizontally with SUS-101-MHW (VFFS) in different sizes of bags easily. Packets are made in a zigzag cutting style making it easy for consumers to open pack from any side.</p>\r\n\r\n<h3><strong>Specification</strong></h3>\r\n\r\n<p><strong>Multiple dates packing machine</strong>&nbsp;is in vertical form. It has ability to pack up to 60 BPM (bags per minute) consequently, many dates per minute are packed in pouches. Machine operator can easily change bag size. Reel width has no limit, custom solutions are available for every customer. It has counter meter to counter number of packets and has photoelectric sensor. It consumes lower energy and based on European standards. User friendly machine, does not require training an operator for longer time. Dates packing machine has 14 multi-head weightier in its feeding system. Film is sealable on heat but it is not applied on paper and polythene bags. An automated system allows user or operator to get notification in the form of alarm as soon as film from the reel ends up. This machine is portable as it has caster wheels and can be adjusted anywhere easily.</p>\r\n\r\n<p><img alt=\"Vertical Date Packaging Machine SUS-101-MHW Specifications\" src=\"data:image/jpeg;base64,\" style=\"height:643px; width:638px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Parts Used In Machine</strong></h3>\r\n\r\n<p><strong><em>SUS-101-MHW dates packing machine</em></strong>&nbsp;is designed to meet international standards by using parts of reliable supplier countries including, Japan, Korea, Germany, Taiwan, France and Italy. Sama engineering keeps on switching the suppliers of parts to keep the quality maintained.</p>\r\n\r\n<p><img alt=\"Vertical Date Packaging Machine SUS-101-MHW Parts\" src=\"data:image/jpeg;base64,\" style=\"height:756px; width:574px\" /></p>\r\n\r\n<h3><strong>Benefits</strong></h3>\r\n\r\n<p>This machine is safe and hazard free with user friendly process &amp; digital system. It makes finished items in speedy and efficient manner. A hygiene method of packing dates with easy to clean surface. It uses servo driven technology. Tower light is installed in the machine to keep the machine user friendly. As it is a machine, it saves time and wastage of materials. Many dates to fulfill market demand can be packed within an hour without any interruption.</p>\r\n\r\n<p><strong>Multiple Dates packaging machine</strong>&nbsp;is durable, made by using&nbsp;<strong>GMP</strong>&nbsp;(General Manufacturing Practices). Packaging of dates by this machine, increases the shelf life of dates and keep dates fresh in packets. This machine is suitable to pack food items as it is hygiene and approved medically. An additional benefit is nitrogen filling that can increase the shelf life by keeping food items fresh after packaging. A finger touch system to control speed and frequency, is installed in machine.</p>\r\n\r\n<h3><strong>CE Certification</strong></h3>\r\n\r\n<p>CE stands for European conformity. CE certified products are declared to be safe, secure and unhazardous. Those products meet European health and protection legislation. Sama Engineering&rsquo;s single date packing machine is CE certified. Amongst all packaging machines manufacturers of Pakistan only Sama engineering has CE certification.</p>\r\n\r\n<p>Here Is Vertical Dates Packaging Machine &ndash; SUS-101-MHW&nbsp;Video Via&nbsp;<strong>YouTube</strong></p>', 'Vertical Dates Packaging Machine SUS-101-MHW', '5c9b126c87d06vertical-dates-packaging-machine-sus-101-mhw.jpg', 1, 0, 0, 'https://youtu.be/g0E3xiAHvPU', '2019-03-26 22:04:28', '2019-03-27 02:17:10');
