(22, 'Dates Chopping Machine Introduced By Sama Engineering', 'dates-chopping-machine-introduced-by-sama-engineering', 12, '<p>&nbsp;</p>\r\n\r\n<h2><strong>Dates Chopping Machine Introduced By Sama Engineering</strong></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dates chopping machine</strong>, introduced by&nbsp;<strong>Sama Engineering</strong>&nbsp;is horizontal and helpful in making small pieces of dates quickly. It has used 304 stainless steel, which is easy to wipe and easy to clean. It uses circular knife group, twisted dragon knife and powder equipment. It has large capacity to chop several dates and works efficiently. An automatic user friendly machine that doesn&rsquo;t require much efforts of operator. This machine is designed a way that is suitable for high sugar content, having sticky knife to cut fruits, including, apple pulp, apricot, strawberries, pear preserved hawthorn, hippophae rhamnoides, raisins, dried haitang, dates etc.</p>\r\n\r\n<p>Sama Engineering&rsquo;s&nbsp;<strong>dates chopping machine</strong>&nbsp;can chop up to 500 Kgs per hours. It can chop in these sizes, 3*3mm, 4*4mm, 5*5mm, 8*8mm and 10*10mm. dimensions are, 1800*700*100mm. Suitable for preserved fruits. Hazard free CE certified.</p>\r\n\r\n<p><em><strong>For buy this Machine</strong>&nbsp;<a href=\"http://www.samaengineering.com/contactus\" target=\"_blank\">Contact Us</a></em></p>\r\n\r\n<p><em><strong>Specification</strong></em></p>\r\n\r\n<p><img alt=\"Dates Chopping Machine Introduced By Sama Engineering Specifications\" src=\"data:image/jpeg;base64,\" style=\"height:378px; width:505px\" /></p>\r\n\r\n<p>Watch&nbsp;<strong>Dates Chopping Machine</strong>&nbsp;Video Via&nbsp;<strong>YouTube</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Dates Chopping Machine Introduced By Sama Engineering', '5c9b12c665035dates-chopping-machine-introduced-by-sama-engineering.jpg', 1, 0, 0, 'https://youtu.be/8FICsFDMlWY', '2019-03-26 22:05:58', '2019-03-27 02:17:10');
