(23, 'Dates Deseeding Machine Introduced by Sama Engineering', 'dates-deseeding-machine-introduced-by-sama-engineering', 12, '<p>&nbsp;</p>\r\n\r\n<h2><strong>Dates Deseeding Machine Introduced by Sama Engineering</strong></h2>\r\n\r\n<p><strong>Date seed removing machine</strong>&nbsp;of Sama Engineering is suitable for several fruits including, dates, plum, olive, hawthorn and so on. A convenient solution for consumers to use pit free fruits. Having different molds and a flexible system to fit with every type of product. New technology making the deseeding process faster, efficient and easy to operate.&nbsp;<strong>Dates pitting machine</strong>&nbsp;has high integrity flesh rate. Equipment is flexible and effective since startup with such features: 304 stainless steel, keeps the machine easy to clean, thick wall square tube, channel steel welding composition, bolts used to assemble all component parts. Feeder, loads material automatically and then&nbsp;<strong>Seed remover machine</strong>&nbsp;works with punch pin from center of dates to remove seeds.</p>\r\n\r\n<p><em><strong>For buy this Machine</strong>&nbsp;<a href=\"http://www.samaengineering.com/contactus\" target=\"_blank\">Contact Us</a></em></p>\r\n\r\n<p><em><strong>Specification:</strong></em></p>\r\n\r\n<p><img alt=\"Dates Deseeding Machine Introduced by Sama Engineering Specifications\" src=\"data:image/jpeg;base64,\" style=\"height:378px; width:608px\" /></p>\r\n\r\n<p>Watch&nbsp;<strong>Dates Deseeding&nbsp;Machine</strong>&nbsp;Video Via&nbsp;<strong>YouTube</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Dates Deseeding Machine Introduced by Sama Engineering', '5c9b13108a666dates-deseeding-machine-introduced-sama-engineering.jpg', 1, 0, 0, 'https://youtu.be/fhgRv30MZ4A', '2019-03-26 22:07:12', '2019-03-27 02:17:10');
