(24, 'Introduction of Direct Puff and Core-Filled Snack Line', 'introduction-of-direct-puff-and-core-filled-snack-line', 18, '<p>&nbsp;</p>\r\n\r\n<p>The&nbsp;<strong>puffed and core filled snack</strong>&nbsp;production line is making use of corn flour, rice flour, wheat flour, corn grits as primary raw material and add water, sugar as ingredients. By changing screw, mold, and some additional equipment, it can produce puffed snacks and also core filled snacks. By injecting cream, chocolate, peanut butter, etc. to the extruded hollowed roll to make many flavors of sandwich meals. The puff snack line can produce many shapes of puffed food, such as round, star shape, a ring shape, flower shape, etc.</p>\r\n\r\n<p><strong><em>Size:</em></strong><em>&nbsp;</em><em>5100&times;1100&times;2150mm,</em><br />\r\n<strong><em>Power Consumption:</em></strong><em>&nbsp;</em><em>65kw,</em><br />\r\n<strong><em>Production Capacity:</em></strong><em>&nbsp;</em><em>200~330kg/h.</em></p>\r\n\r\n<h3><strong>Product Process Line:&nbsp;</strong></h3>\r\n\r\n<p>Starting from Mixer, the Puff filled snack line automatically feed and extrude the ingredients from twin screw.&nbsp; The core is filling machine with a Multi-functional shaper that helps you to shape food on the way you want.&nbsp; Large elevator to moves goods, a Dry and Oil Spraying Flavour line.</p>\r\n\r\n<h3><strong>How to buy Direct Puff &amp; Core-Filled Snack Line:</strong></h3>\r\n\r\n<p>Sama Engineering, founded in 1978 a leading stop shop when you need packaging or processing machines. Becoming more and more popular due to its multiple advantages over other types of materials here just linking the&nbsp;<a href=\"http://www.samaengineering.com/processing-system/Direct-PuffCore-Filled-Snack-Line\" target=\"_blank\">Direct Puff &amp; Core-Filled Snack Line</a>&nbsp;in the case of how comfortably you can buy Snack Line Machine. Contact us directly using form, we will respond your ticket in no time.</p>\r\n\r\n<p><strong>Direct Puff &amp; Core-Filled Snack Line Video via YouTube:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<pre>\r\n<strong>Find More Details Or Buy The Machine </strong><strong><a href=\"https://business.facebook.com/hashtag/follow?source=feed_text&amp;story_id=1191476387602245\">Follow</a></strong><strong>:</strong></pre>\r\n\r\n<pre>\r\n<strong><a href=\"https://business.facebook.com/hashtag/whatsapp?source=feed_text&amp;story_id=1191476387602245\">Whatsapp</a></strong>: +92 3452266211</pre>\r\n\r\n<pre>\r\n<strong><a href=\"https://business.facebook.com/hashtag/email?source=feed_text&amp;story_id=1191476387602245\">Email</a></strong>: info@samaengineering.com | sales@samaengineering.com</pre>\r\n\r\n<pre>\r\n<strong><a href=\"https://business.facebook.com/hashtag/phone?source=feed_text&amp;story_id=1191476387602245\">Phone</a></strong><strong>:</strong> +92 (21) 36688883 | +92 (21) 36602467 | +(92) 3452266208</pre>\r\n\r\n<pre>\r\n<strong><a href=\"https://business.facebook.com/hashtag/website?source=feed_text&amp;story_id=1191476387602245\">Website</a></strong><strong>:</strong> <a href=\"http://bit.ly/2kajgNT\" target=\"_blank\">http://bit.ly/1FVAYqb</a></pre>\r\n\r\n<p>&nbsp;</p>', 'Introduction of Direct Puff and Core-Filled Snack Line', '5c9b13635090bintroduction-direct-puff-core-filled-snack-line.jpg', 1, 0, 0, 'https://www.youtube.com/watch?v=NuVWyDGmD0g&feature=youtu.be', '2019-03-26 22:08:35', '2019-03-29 06:17:30'),
(25, 'Introduction of Popcorn Production Line – Snack Processing Systems', 'introduction-of-popcorn-production-line-snack-processing-systems', 18, '<p>This production line is a whole automatic process line for expanding American corn granule into different shapes, learned from American advanced technology, combine high temperature and hot air circulation system to make high heat efficiency, low production cost, easy operation, then get perfect popcorn, after coating caramel, the taste is very popular with all kinds of people.</p>\r\n\r\n<p>This popcorn production equipment line uses forward expelling technology by&nbsp;<strong>Sama manufacturing process</strong>, can produce the popcorn with caramel coating and a yummy taste to meet the increasing market demands. It has high heating performance, low running cost and strong flexibility have earned good praise and favor from the public.</p>\r\n\r\n<h3><strong>Key features of Caramel Popcorn Production Line:</strong></h3>\r\n\r\n<ol>\r\n	<li>Heating system equipped with advanced temperature control and display equipment to assure stable drying and high heating efficiency.</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li>The variable speed drive motor adopts the steady and reliable variable frequency speed regulation and steps less speed adjusting system.</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li>Low power, low running cost, less machine maintenance.</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li>Strong adaptability, excellent products quality.</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li>High automation degree and labor-saving.</li>\r\n</ol>\r\n\r\n<h3><strong>Steps of Popcorn Processing Line:</strong></h3>\r\n\r\n<p>Popcorn machine uses to feed the corns beans on the space then, starts here: operator loads the corn kernel into floor hopper, bucket elevator delivers corn as needed to the popper, operate to the air popper and removes un-popped and under-sized popped kernels. The both ways to use either for&nbsp;<strong>caramel popcorns</strong>&nbsp;or&nbsp;<strong>savory popcorns</strong>.</p>\r\n\r\n<h3><strong>Exit end-View:</strong></h3>\r\n\r\n<p>A couple of lines for Savory and caramel, go for the caramel for this article. Popped corn is warmed in a Floor Hopper until it is delivered to the caramel Ketter or Coater. Each premix kettles is fitted with a high-speed impeller mixer and a low-speed, scraped-wall mixer.&nbsp; Caramel ingredients are dissolved and pre-heated in the Kettles.</p>\r\n\r\n<h3><strong>Recycle loop:</strong></h3>\r\n\r\n<p>The syrup is pumped from the premix kettles through a recycle loop; Oil is blended and heated in the lecithin tank, and with the process of few other lines it gets to the spray of caramels and produces the tasty caramel popcorns.</p>\r\n\r\n<p>&nbsp;</p>', 'Introduction of Popcorn Production Line – Snack Processing Systems', '5c9b13da7f529introduction-popcorn-production-line.jpg', 1, 0, 0, NULL, '2019-03-26 22:10:34', '2019-03-27 02:17:10'),
(26, 'Sama Engineering is Participating in Karachi Expo Center, Pakistan.', 'sama-engineering-is-participating-in-karachi-expo-center-pakistan', 8, '<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://www.samaengineering.com/\">SAMA Engineering</a>, a leading&nbsp;<a href=\"https://www.samaengineering.com/\">packaging machines</a>, and&nbsp;<a href=\"https://www.samaengineering.com/\">processing system</a>&nbsp;<a href=\"https://www.samaengineering.com/\">manufacturer&nbsp;</a>is participating in this year&rsquo;s food Tech Asia 2018 from 10 to 12 April 2018. Showing off their explicit number of packaging machines and processing systems,&nbsp;Exposing the industries about the latest ways of&nbsp;<a href=\"https://www.samaengineering.com/\">Packaging&nbsp;</a>and&nbsp;<a href=\"https://www.samaengineering.com/\">Processing System</a>. The&nbsp;<a href=\"https://www.samaengineering.com/\">SAMA&nbsp;</a>company was founded in 1978 by Mr. Muhammad Umer Sama to provide complete solutions to FMCG sectors. Currently, we are exporting to 34 countries with a promise to deliver high quality, service and excellent value for their money. We welcome all the industries and people related to this field to come and avail the opportunity to witness the recent advancement in the field of packaging machines and processing lines, So come and join us in this event happening in&nbsp;<a href=\"https://www.samaengineering.com/\">Expo center Karachi</a>, Pakistan</p>\r\n\r\n<p><strong>Address</strong>:<br />\r\n+92 (21) 36688883<br />\r\n+92 (21) 36603311<br />\r\ninfo@samaengineering.com<br />\r\nsales@samaengineering.com<br />\r\nNazimabad # 2, Block-A, Plot No. 1/32, Opposite Firdous Colony KHI-74600 Pakistan</p>', 'Sama Engineering is Participating in Karachi Expo Center, Pakistan.', '5c9b144376e51Expo-April-Post-New_Linkedin.jpg', 1, 0, 0, NULL, '2019-03-26 22:12:19', '2019-03-27 02:17:10'),
(27, 'Yet Another Successful Exhibition', 'yet-another-successful-exhibition', 8, '<p>SAMA Engineering has been one of the pioneers in machine manufacturing and in different packings and processing lines, Being the pioneer, SAMA Engineering participated in this year&rsquo;s Food and Tech Asia International Exhibition 2019 which was held from 26th to 28th of April. Showing off their numerous number of packaging machines and processing systems, Revealing the industries about the latest ways of Packaging and Processing System. SAMA displayed above 30 latest packing and processing machines which was highly appreciated and liked by the exhibitors, SAMA always aims to deliver the best to their respective clients which has resulted as their potential growth and made them one of the big fishes of the industry across the country.</p>\r\n\r\n<p><br />\r\nWe gratefully welcomed all the industries and people related to this field who come to availed the opportunity to witness the recent advancement in the field of packaging machines and processing lines, with all gratitude and veneration SAMA Engineering is thankful to all the people who made this exhibition yet another success and accomplishment.</p>', 'SamaEngineering, a leading packaging machines manufacturer participating in Exhibition', '5ccaec4c1223bWhatsApp Image 2019-05-02 at 18.02.59.jpeg', 0, 0, 0, 'http://samaengineering.com/', '2019-05-02 05:10:36', '2019-05-02 05:10:36');
