(28, 112, 'Direct Puff/Core-Filled Snack Line', 'direct-puffcore-filled-snack-line', '<p>Direct puff and core-filled snack use wheat flour, bean powder, tuber crops material, vegetable powder as the raw material.</p>', '<p><strong>Model: SAM-DP &nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>Direct puff and core-filled snack use wheat flour, bean powder, tuber crops material, vegetable powder as the raw material.&nbsp;</li>\r\n	<li>Via the effect of an extrusion machine, to produce multiple types, different shapes, crispy and tasty snack.</li>\r\n	<li>Due to it is a profitable project with less investment, It won the clients trust and favour.</li>\r\n</ul>', 'https://www.youtube.com/embed/NuVWyDGmD0g', 0, '5c9793d3c8b2fDirect-Puff-Core-Filled-Snack-Line-final.jpg', '5c9793d3c7fbe31-07-2017-02-37-53pm5431-ilovepdf-compressed.pdf', 1, 2, '2019-03-24 06:27:32', '2019-04-09 04:18:27'),
(29, NULL, 'Breakfast Cereal/Corn Flake Processing Line', 'breakfast-cerealcorn-flake-processing-line', 'Breakfast Cereal &Corn Flakes is a newly popular instant food. Longer storage time...', '<p><strong>Model: SAM-BC/CF</strong></p>\r\n\r\n<ul>\r\n	<li>Breakfast Cereal &amp;Corn Flakes is a newly popular instant food. Longer storage time, easy to carry, nice flavouring after mixing with different milk product as the breakfast, make it becoming a favourable, convenient, and healthy food for modern people.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>It can use corn flour, wheat flour, and other grain material as the main material, through mixing, extrusion, flaking, drying, toasting and then coating with sugar syrup, and cooling to obtain the snack with crispy, sweet, and various shapes.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'https://youtu.be/7ZUI8o-Kcbw', 2, '5c9796dacebe7Break-Fast-Cereal-And-Corn-Flask.jpg', '5c9796dace30701-08-2017-05-08-12am895breakfast creal-ilovepdf-compressed.pdf', 0, 1, '2019-03-24 06:40:26', '2019-03-25 08:28:52'),
(30, 112, 'Bread Crumb/Panko/Tempura Line', 'bread-crumbpankotempura-line', '<p>Bread crumb is commonly used for the products that need fried,...</p>', '<p><strong>Model: SAM-BPT</strong></p>\r\n\r\n<p>Bread crumb is commonly used for the products that need fried, crisp outside and meltingly soft inside. Replacing the traditional production technology, SinoPuff bread crumb production line is effective with fewer waste materials. Through mixing, cooking, crushing and screening, this production line can make various shapes of bread crumbs such as Japanese long needle shape, US granular shape, snowflake shape and so on.</p>\r\n\r\n<p>&nbsp;</p>', 'https://youtu.be/CA0UA4wHTZ8', 1, '5ccafe238d400Bread-Crumb-Panko-Tempura-Line.jpg', '5c9797cd13bfb01-08-2017-05-12-49am858Bread crumbs-ilovepdf-compressed.pdf', 1, 2, '2019-03-24 06:44:29', '2019-05-02 06:26:43'),
(31, NULL, 'Cheetos Kurkure Nik Nak Processing Line', 'cheetos-kurkure-nik-nak-processing-line', 'Cheetos is brand of cheese-flavored, puffed cornmeal snacks,', '<p><strong>Model: SAM-CKN</strong></p>\r\n\r\n<p>Cheetos is a brand of cheese-flavoured, puffed cornmeal snacks, Cheetos are manufactured by blending corn and water. The mixture is heated under pressure and then extruded through a die. The texture of the snack is formed as a result of contact with hot air, causing steam in the mixture to expand and creating its characteristic texture. After oven-drying or frying, the product is then tumbled with the desired flavour components.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'https://youtu.be/Mk33dzK8_w4', NULL, '5c979c4dc59cdCheetos---Kurkure---Nik-Nak.jpg', '5c979c4dc50d601-08-2017-05-12-22am437cheetos kukure & Nik Nak-ilovepdf-compressed.pdf', 1, 2, '2019-03-24 07:03:41', '2019-03-25 08:28:52'),
(32, NULL, 'Doritos / Tortilla / Corn Chip Processing Line', 'doritos-tortilla-corn-chip-processing-line', 'Doritos was produced since 1964 and sell all over the world.', '<p><strong>Model: SAM-DTCC</strong></p>\r\n\r\n<p>Doritos was produced since 1964 and sell all over the world. The main raw material is corn powder, the mixture is heated under pressure, and then extruded through a die, then use the shaper to make it, the texture of the snack is formed as a result of contact with hot air, causing steam in the mixture to expand and creating its characteristic texture. After frying, the product is then tumbled with the desired flavour components.</p>\r\n\r\n<p>&nbsp;</p>', 'https://youtu.be/LTg9HTCht5M', NULL, '5c979dfbd5b7fjpeg.jpg', '5c979dfbd528601-08-2017-05-12-32am106dorits-ilovepdf-compressed.pdf', 1, 0, '2019-03-24 07:10:51', '2019-03-25 08:28:52'),
(33, NULL, 'Fried Wheat Flour Processing Line', 'fried-wheat-flour-processing-line', 'Fried wheat flour snacks machine is for processing dough with wheat', '<p><strong>Model: SAM-FW/FB</strong><br />\r\n<br />\r\n<br />\r\nFried wheat flour snacks machine is for processing dough with wheat flour, and then shaping and cutting the skin into forming products. After being pressed by serious stainless rollers, they can be separately cut into pillow or stick shapes and expanded by frying. After that, they can be flavor-mixed and flavour-mixed become appetizing and snack foodstuff. This line is reasonably designed and conveniently operated.</p>\r\n\r\n<p>&nbsp;</p>', 'https://youtu.be/LTg9HTCht5M', NULL, '5c97a0004a4eajpeg.jpg', '5c97a00049c2701-08-2017-05-12-08am409fried wheak-ilovepdf-compressed.pdf', 1, 0, '2019-03-24 07:19:28', '2019-03-25 08:28:52'),
(34, NULL, '2D & 3D Pellet / Fryum Processing Line', '2d-3d-pellet-fryum-processing-line', 'With our segment screw technology to ensure the precise control during p', '<p><strong>Model:</strong><strong> SAM-NR</strong></p>\r\n\r\n<p><br />\r\nWith our segment screw technology to ensure the precise control during production, you can have a multiple choice to use different materials to make higher quality, multiple types pellet This line can use wheat flour, corn starch, potato starch, whole potato flour as raw material. Through screw extruding, it shapes various types of shape, through drying, frying and flavouring, it makes puffed leisure snacks with the crispy, tasty mouthfeel, smooth surface, and different vivid shapes.</p>\r\n\r\n<h2><strong>Production Process Line:</strong><br />\r\n&nbsp;</h2>\r\n\r\n<ul>\r\n	<li>Flour Mixer&nbsp;</li>\r\n	<li>Automatic Feeder</li>\r\n	<li>Double Screw Extruder ( With Cooling Tower, Water Injector)</li>\r\n	<li>Pattern Machine</li>\r\n	<li>Compounding Machine</li>\r\n	<li>Lifter</li>\r\n	<li>Recycling Dryer</li>\r\n	<li>Continuous Fryer</li>\r\n	<li>De-oiler</li>\r\n	<li>Flavouring Line</li>\r\n</ul>\r\n\r\n<p>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', 'https://youtu.be/1zDzkRX9ijQ?list=PLKY1mSy_UtDpiwOc8G9-EZ2HRwkI0ql31', NULL, '5c97a1931b5682D-&-3D-Pellet-Fryum-Line.jpg', '5c97a1931ab8601-08-2017-05-05-35am4162d and 3d pellet-ilovepdf-compressed.pdf', 1, 0, '2019-03-24 07:26:11', '2019-03-25 08:28:52'),
(35, NULL, 'Popcorn Processing Line', 'popcorn-processing-line', 'This production line is a whole automatic process line for expanding', '<p><strong>Model</strong><strong>: SAM-PC 100</strong></p>\r\n\r\n<p><br />\r\nThis production line is a whole automatic process line for expanding American corn granule into different shape, learned from American advanced technology, combine high temperature and hot air circulation system to make high heat efficiency, low production cost, easy operation, then get perfect popcorn, after coating machine to or caramel, the taste is very popular in all kinds of people.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, 1, '5c97a2ee7894aPopcorn-Machine.png', '5c97a2ee77f4f01-08-2017-05-06-02am663popcorn line-ilovepdf-compressed.pdf', 1, 0, '2019-03-24 07:31:58', '2019-03-25 08:28:52'),
(36, 112, 'Potato Chips / French Fries Line', 'potato-chips-french-fries-line', 'This process line is to produce freshly fried potato chips', '<p><strong>Model: SAM-PCFF</strong></p>\r\n\r\n<p><br />\r\nThis process line is to produce freshly fried potato chips or French fries, from washing &amp; peeling potato chips, then using different knives make into flat or wave shape potato chips or stick shape, then blanching, drying, and frying and flavouring to make into tasty potato chips or French fries.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', 'https://youtu.be/myLAgj7p-10', 0, '5c97a5c9db575Potato-Chips-&-French-Fries-Line.png', '5c97a5c9dab2801-08-2017-05-06-02am663popcorn line-ilovepdf-compressed.pdf', 1, 0, '2019-03-24 07:44:09', '2019-03-25 23:11:02'),
(37, NULL, 'Pet Food / Animal Feed Line', 'pet-food-animal-feed-line', 'This processing line is specially designed to produce pet daily and healthy food,', '<p><strong>MOdel</strong><strong>: SAM-PF</strong><strong>/AF</strong></p>\r\n\r\n<p>This processing line is specially designed to produce pet daily and healthy food, also animal feed for every kind of animals. Normally using grains powder as main material, mixing with meat, bones powder, fish powder as a flavouring Through Adopting pre-conditioning system for raw material, it can increase capacity and reduce power consumption. This line would satisfy different demands for capacity and quality. At the same time, we focus on palatability and scientific nutritional proportion, which make pet food more easily digested and absorbed. On the base of this line, we would like to reach multi-level and comprehensive cooperation with every client in this trade.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Equipment Project:</strong></h2>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Console</p>\r\n	</li>\r\n	<li>\r\n	<p>Double-screw extruder</p>\r\n	</li>\r\n	<li>\r\n	<p>Air conveyor</p>\r\n	</li>\r\n	<li>\r\n	<p>Three-layer roasting oven</p>\r\n	</li>\r\n	<li>\r\n	<p>Elevator</p>\r\n	</li>\r\n	<li>\r\n	<p>Flavouring line</p>\r\n	</li>\r\n	<li>\r\n	<p>Elevator</p>\r\n	</li>\r\n	<li>\r\n	<p>Cooling conveyor&nbsp;</p>\r\n	</li>\r\n</ul>', NULL, NULL, '5c97a7d209a71Pet-Food---Animal-Feed-Line.png', '5c97a7d20909e01-08-2017-05-11-54am303Pet food-ilovepdf-compressed.pdf', 1, 0, '2019-03-24 07:52:50', '2019-03-25 08:28:52'),
(38, NULL, 'High Moisture TVP / TSP / Soya Protien Line', 'high-moisture-tvp-tsp-soya-protien-line', 'This process line uses soybean meal or wheat gluten as main raw materials', '<p><strong>Model: SAM-SP</strong></p>\r\n\r\n<p>This process line uses soybean meal or wheat gluten as main raw materials, after high temperature and high pressure extruding and cutting to produce textured protein and fibre protein with a certain strength and toughness like the meat, easy to digest, high nutritional, it is more and more loved by people.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'https://youtu.be/ekb5DJOXlzw', 0, '5c97aa3d6c63fjpeg.jpg', '5c97aa3d5b6d601-08-2017-05-07-54am268high miisture TVP-ilovepdf-compressed.pdf', 1, 0, '2019-03-24 08:03:09', '2019-03-25 08:28:52'),
(39, NULL, 'Nuts Roaster Line', 'nuts-roaster-line', 'Widely Applied Raw Material: Peanuts, Chestnut, Almond, Cashew,', '<p><strong>Model: SAM-PNR</strong></p>\r\n\r\n<ul>\r\n	<li>Widely Applied Raw Material: Peanuts, Chestnut, Almond, Cashew, Coffee Bean, Sunflower Seeds and etc.</li>\r\n	<li>Multiple Fuels to Choose: Coal, Diesel, Electric, Gas.</li>\r\n	<li>Roasted evenly: Through thermal radiation, air convection principle and rotating drums, the raw material not directly connected with the fire, to avoid over-cooked material, and assure obtaining the final product with a smooth surface, lustre colour and evenly cooked.</li>\r\n	<li>Auto Temperature Control: The working temperature can be well controlled because this machine has an automatic temperature controller.</li>\r\n	<li>Quality Certificate: ISO9001:2008/CE approved, All the parts connect to food is SS304.</li>\r\n</ul>', NULL, 0, '5c97ac317447219-1.jpg', '5c97ac3173bc301-08-2017-05-07-54am268high miisture TVP-ilovepdf-compressed.pdf', 1, 0, '2019-03-24 08:11:29', '2019-03-25 08:28:52'),
(40, NULL, 'Namkeen Baking Machine', 'namkeen-baking-machine', 'All types of namkin like nylon sev, ratlami sev, champakali', '<h2><strong>Application</strong></h2>\r\n\r\n<ul>\r\n	<li>All types of namkin like nylon sev, ratlami sev, champakali</li>\r\n	<li>Fulavadi, ompudi, papdi, gathai &amp; bhujia.</li>\r\n</ul>\r\n\r\n<p><strong>Features</strong></p>\r\n\r\n<ul>\r\n	<li>No Electricity Required</li>\r\n	<li>Fuel: LPG / PNG</li>\r\n	<li>Air Consumption: 1 CFM @ 6KG Air Pressure</li>\r\n	<li>Output Capacity: 50Kg to 200Kg Per Hour</li>\r\n	<li>Air Pressure: 4Kg, 0.6C</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'https://youtu.be/B_I0-VRBb0s', 1, '5c97c3f661f7djpeg.jpg', '5c97c3f6612a131-07-2017-02-37-53pm5431-ilovepdf-compressed.pdf', 1, 0, '2019-03-24 09:52:54', '2019-03-25 08:28:52'),
(41, NULL, 'Planetary Mixer', 'planetary-mixer', 'Suitable for making ice cream, bread, butter, egg, Sugar, sauces, milk, paste and so on.', '<p><strong>Model: SAM-SB-DM &nbsp;</strong></p>\r\n\r\n<p><strong>Application </strong></p>\r\n\r\n<p>Suitable for making ice cream, bread, butter, egg, Sugar, sauces, milk, paste and so on. &nbsp;</p>\r\n\r\n<p>Frequency: 50Hz</p>\r\n\r\n<p>Mixer rotating&nbsp; speed ( min ) : 74</p>\r\n\r\n<p>&nbsp;</p>', 'https://youtu.be/0Sa_W81GwEM', 1, '5c97c70844859JPEG.jpg', '5c97c70843b1e31-07-2017-02-37-53pm5431-ilovepdf-compressed.pdf', 1, 0, '2019-03-24 10:06:00', '2019-03-25 08:28:52'),
(42, NULL, 'Rusgulla & Gulab Jamun Making Machine', 'rusgulla-gulab-jamun-making-machine', 'Rasgulla Gulab Jamun making machine is usefull for making various types of sweets like peda, rasgulla, gulabjamun, rasmalai etc.', '<h2><strong>Specifications:</strong></h2>\r\n\r\n<p>Rasgulla Gulab Jamun making machine is useful for making various types of sweets like peda, rasgulla, Gulab Jamun, rasmalai etc.</p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<p>With ingenious manufacturing guidelines and expertise, our company presents&nbsp;<strong>Gulab Jamun Making Machines</strong>&nbsp;that is widely used in hotels, restaurants, hostels and other industrial kitchens. We, Sama Engineering, are one of the reputed organizations, involved in manufacturing and supplying sweet making machines like&nbsp;<strong>Gulab Jamun Making Machines</strong>. The machines are precisely engineered and are known for notable attributes such as extraordinary finish, easy operation, minimal maintenance, corrosion resistivity and durability.</p>\r\n\r\n<p>These machines are widely used in canteens, kitchens, hotel kitchens and commercial kitchens. The automatically functioned applications in the machines are simple yet new and advanced. These are designed in a simple manner to operate and function well.</p>\r\n\r\n<ul>\r\n	<li>Time-saving features</li>\r\n	<li>Gentle process</li>\r\n	<li>Easy storage containers</li>\r\n	<li>High-quality stainless steel used</li>\r\n</ul>\r\n\r\n<p>The machine allows to remove, sterilize and clean individual parts, adding an extra measure of safety to the process of producing gulab jamun. Customization is also acceptable at industrial prices.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, '5c97c8cd3b9bfRusgulla-&-Gulab-Jamun-Making-Machine.jpg', '5c97c8cd3afa101-08-2017-05-05-35am4162d and 3d pellet-ilovepdf-compressed.pdf', 0, 0, '2019-03-24 10:13:33', '2019-03-25 08:28:52'),
