(105, NULL, 'Induction Sealing INS-01', 'induction-sealing-ins-01', '<p>It is used for the aluminum foil sealing of all kinds of round, square and special-shaped bottles for foods, medicines, cosmetics, daily chemicals etc.</p>', '<p>Induction Sealing INS-01</p>\r\n\r\n<p>It is used for the aluminum foil sealing of all kinds of round, square and special-shaped bottles for foods, medicines, cosmetics, daily chemicals etc.</p>', NULL, 1, '5c9e279ac4c8cjpeg.jpg', '5c9e279ac4af3Doc1.pdf', 1, 0, '2019-03-29 06:11:38', '2019-03-29 06:11:38'),
(106, NULL, 'Crawler Capping Machine SC-01', 'crawler-capping-machine-sc-01', '<p>It applies to capping &amp; sealing of bottles for soy sauce vinegar &amp; vegetable oil &amp; similar types of bottles.</p>', '<p>Crawler Capping Machine SC-01</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>It applies to capping &amp; sealing of bottles for soy sauce vinegar &amp; vegetable oil &amp; similar types of bottles.</p>', NULL, 1, '5c9e2e0fae58cjpeg.jpg', '5c9e2e0fae391Doc1.pdf', 1, 0, '2019-03-29 06:39:11', '2019-03-29 06:39:11'),
(107, NULL, 'Capping Machine SC-02', 'capping-machine-sc-02', '<p>It is used for cap screwing of round bottles, square bottles or oblate bottles.</p>', '<p>Capping Machine SC-02</p>\r\n\r\n<p>It is used for cap screwing of round bottles, square bottles or oblate bottles.</p>', NULL, 1, '5c9e2f0d75b77jpeg.jpg', '5c9e2f0d759b2Doc1.pdf', 0, 0, '2019-03-29 06:43:25', '2019-03-29 06:43:25'),
(108, NULL, 'Rotary Capping Machine SC-03', 'rotary-capping-machine-sc-03', '<p>It applies to screwing and sealing of thread caps for food, pharmacy, daily use chemicals, pesticides and chemicals.</p>', '<p>Rotary Capping Machine SC-03</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>It applies to screwing and sealing of thread caps for food, pharmacy, daily use chemicals, pesticides and chemicals.</p>', NULL, 1, '5c9e30c83806ajpeg.jpg', '5c9e30c837e5cDoc1.pdf', 1, 0, '2019-03-29 06:50:48', '2019-03-29 06:50:48'),
(109, NULL, 'Round Object Labelling Machine LA-1', 'round-object-labelling-machine-la-1', '<p>It is used for on round type, elliptical type, square type and curve type bottle.</p>', '<p>Round Object Labelling Machine LA-1</p>\r\n\r\n<p>It is used for on round type, elliptical type, square type and curve type bottle.</p>', NULL, 1, '5c9e325971801jpeg.jpg', '5c9e325971620Doc1.pdf', 1, 0, '2019-03-29 06:57:29', '2019-03-29 06:57:29'),
(110, NULL, 'Glue Labeling Machine  GLA – 01', 'glue-labeling-machine-gla-01', '<p>Glue labelling machine used to label the round bottles, mainly used in pharmaceutical, cosmetic, beverages and other related industries.</p>', '<p>Glue Labeling Machine &nbsp;GLA &ndash; 01</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Glue labelling machine used to label the round bottles, mainly used in pharmaceutical, cosmetic, beverages and other related industries.</p>', NULL, 1, '5c9e33af76478jpeg.jpg', '5c9e33af762eeDoc1.pdf', 1, 0, '2019-03-29 07:03:11', '2019-03-29 07:03:11'),
(111, NULL, 'Flat Object Labelling Machine  LA-2', 'flat-object-labelling-machine-la-2', '<p>It is used for the upper surface of labels or adhesive film such as books, folders, boxes, cartons, top of any product etc.</p>', '<p>Flat Object Labelling Machine &nbsp;LA-2</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>It is used for the upper surface of labels or adhesive film such as books, folders, boxes, cartons, top of any product etc.</p>', NULL, 1, '5c9e34a7b3489jpeg.jpg', '5c9e34a7b3301Doc1.pdf', 1, 0, '2019-03-29 07:07:19', '2019-03-29 07:07:19');
INSERT INTO `products` (`id`, `p_category`, `p_title`, `p_slug`, `p_short_desc`, `p_long_desc`, `p_video_link`, `p_theme`, `p_main_image`, `p_pdf`, `p_status`, `p_slider_id`, `created_at`, `updated_at`) VALUES
(112, NULL, 'Dough Divider Rounder (DDR)', 'dough-divider-rounder-ddr', '<p><strong>Application:</strong></p>\r\n\r\n<p>This machine is suitable for dividing and rounding the dough automatically.&nbsp;</p>', '<ul>\r\n	<li>Machines for dough processing like dividers, rounder, moulders or even automatic proofers have been designed to save time and bring comfort and productivity to bakers.</li>\r\n	<li>The dough divider &amp; rounder is semi-automatic design</li>\r\n	<li>The DDR is a machine for dividing and rounding dough.</li>\r\n	<li>Manual dividing and motorized rounding on the Oscillating platform.</li>\r\n	<li>This equipment merges in the same cycle the operations of dividing and rounding.</li>\r\n	<li>The operation is simple and one operator is needed to turn out up to 2800pc./hr. &nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Features:</strong></p>\r\n\r\n<ul>\r\n	<li>Divides and rounds the dough to 30/36 equal pieces automatically. &nbsp;</li>\r\n	<li>You can adjust the dough from 25g-100g according to your need.&nbsp;</li>\r\n	<li>Divides and round the dough within 10 seconds.</li>\r\n	<li>Helps to Improve working efficiency and save labour.</li>\r\n	<li>Perfectly scales and rounds pieces&nbsp;</li>\r\n	<li>PVC moulding plate</li>\r\n	<li>No oil in or above product zone</li>\r\n	<li>Easy snap on and off head cover for easy cleaning&nbsp;</li>\r\n</ul>', NULL, 1, '5c9e3a3ab7028Dough-Divider-Rounder-(DDR).jpg', '5c9e3a3ab6ea15c93f79a5e183Doc1.pdf', 1, 0, '2019-03-29 07:31:06', '2019-03-29 07:31:06'),
(113, NULL, 'DOUGH DIVIDER ROUNDER (SPIRAL)', 'dough-divider-rounder-spiral', '<p>SAM-SBDR &nbsp;dough making machine is suitable for producing dough buns, It divides the dough in equal parts and make a ball shape.</p>', '<ul>\r\n	<li>Sam-sbdr dough making machine is the original steamed bread shaping machine,&nbsp;</li>\r\n	<li>The machine is suitable for &nbsp;dividing and rounding dough into balls by water with wheat flour, additives and others food materials.</li>\r\n	<li>The product of high transmission efficiency, compact structure, easy to adjust, secure and&nbsp;reliable.</li>\r\n	<li>Suitable for processing flour bread, forming a bun, smooth appearance and sweet taste of the food.&nbsp;</li>\r\n	<li>The dough divider/steamed bread molding machine is produced with unique&nbsp;design.</li>\r\n	<li>The food produced by this machine shows good color, regular and sleek shape, and also tastes&nbsp;sweet.</li>\r\n	<li>It has characters of high efficiency and compact structure. The size of the finished products can be adjusted easily and three molding-dies can be chosen.</li>\r\n	<li>Clutch as the weight controlling part is more reliable, safer and more convenient to be maintained and operated.</li>\r\n	<li>Sam-sbdr dough making machine is suitable for producing dough buns,&nbsp;</li>\r\n	<li>Which is consistent with national food machinery, food hygiene regulations and requirements.&nbsp;</li>\r\n	<li>This small dough balls maker machine is widely used in organizations, school dining rooms, steamed bread processing units.</li>\r\n</ul>', NULL, 1, '5c9e3b6bd63a0Dough-Divider-Rounder(s)-Making-Machine-(SAM-SBDR).jpg', '5c9e3b6bd61da5c93f79a5e183Doc1.pdf', 1, 0, '2019-03-29 07:36:11', '2019-03-29 07:36:11'),
(114, 91, 'DOUGH REST MACHINE', 'dough-rest-machine', '<p><strong>Dough Rest Machine (SAM-SBM-750)</strong></p>', '<ul>\r\n	<li>After the division of the dough following the mixing process, with most doughs, it is necessary to leave the dough to rest to ensure best moulding or rounding process.</li>\r\n	<li>Unlike the basic solution to leave the dough to rest on a bench or trays in racks, proofing in a manual proofer offers many advantages.</li>\r\n	<li>The main asset is space saving.&nbsp;</li>\r\n	<li>In a limited space, it is possible to store up to 400 dough balls.</li>\r\n	<li>This space saving is even more important when the moulder is placed on the top of the proofer.</li>\r\n	<li>Another asset is comfort compared to the solution of placing on trays which are stored on a trolley.</li>\r\n	<li>The operator does not have to bend down to the place and take out the heavy trays on the trolley.</li>\r\n	<li>The operator has all dough pieces at working level providing ideal ergonomics for this process.&nbsp;</li>\r\n	<li>Lastly, in terms of hygiene and respect of the dough; the dough pieces do not get a skin, unlike the solution that places them on a table or work unit.</li>\r\n	<li>The operator picks up the dough pieces divided thanks to the&nbsp;hydraulic divider&nbsp;and places them manually in the proofer.</li>\r\n	<li>Depending on the model purchased, the operator can put 6 to 10 dough pieces per pocket and some can have as many as 40 pockets.</li>\r\n</ul>', NULL, 1, '5c9e3c1fa91acDough-Rest-Machine-(SAM-SBM-750).jpg', '5c9e3c1fa8fbb5c93f79a5e183Doc1.pdf', 1, 0, '2019-03-29 07:39:11', '2019-03-29 07:41:23'),
(115, NULL, 'Dough Sheeter', 'dough-sheeter', '<p>Suitable for crisp food and multi-layer food, such as croissant, puffed pastries, Danish, flaky pastries, soft pastry dough and stiff pizza.</p>', '<ul>\r\n	<li>Our Table top / Floor standing Dough Sheeter is suitable for bakeries, confectioneries, hotels, restaurants and large kitchens to make crisp food and multi-layer food, such as croissant, puffed pastries, Danish, flaky pastries, soft pastry dough and stiff pizza;</li>\r\n	<li>Stable, robust construction;</li>\r\n	<li>Easy transportation for various working process;</li>\r\n	<li>Minimum space requirement;</li>\r\n	<li>Automatic reversing gear;</li>\r\n	<li>Motorized sheeting tables;</li>\r\n	<li>Easy to clean;</li>\r\n	<li>Excellent quality of chromium plated rollers with scraper.</li>\r\n	<li>Table top and floor standing are optional.</li>\r\n	<li>Crisp food making machine,&nbsp;multi-layer food making machine, such as croissant&nbsp;making machine, puffed pastries&nbsp;making machine, Danish&nbsp;making machine, flaky pastries&nbsp;making machine, soft pastry dough&nbsp;making machine and stiff pizza&nbsp;making machine.</li>\r\n</ul>', NULL, 1, '5c9e3da4447a3Dough-Sheeter.jpg', '5c9e3da4446145c93f79a5e183Doc1.pdf', 0, 0, '2019-03-29 07:45:40', '2019-03-29 07:45:40'),
(116, NULL, 'Dumpling machine', 'dumpling-machine', '<p>It can make samosa, spring roll, dumpling, wonton, fried dumpling, Lace dumpling, Flat dumpling, Quadrate dumpling etc.<br />\r\n&nbsp;</p>', '<ul>\r\n	<li>You need not buy the wrapper machine, just put the paste and the stuffing into the machine, it can make the dumpings automatically.</li>\r\n	<li>It is very economical and practical.</li>\r\n	<li>It is suitable for dumpling restaurant, food supplier, hotel, dining hall, canteens and individual caterings, especially for instant frozen dumpling suppliers.</li>\r\n	<li>The stuffing of these finished products can be all kinds of 100% meats, all kinds of 100% vegetables and mixture of meat and vegetable.</li>\r\n	<li>It is suitable for all kinds of filling of dumplings, such as meat filling, meat dishes mixed filling, whole turnip filling.</li>\r\n	<li>Dumpling shape is beautiful.</li>\r\n	<li>Finished products can be boiled, steamed, fried and processed into frozen food.</li>\r\n	<li>Samosa making a machine, spring roll&nbsp;making machine, dumplings making machine, wonton&nbsp;making machine, fried dumpling&nbsp;making machine, Lace dumpling&nbsp;making machine, Flat dumpling&nbsp;making machine, Quadrate dumpling&nbsp;making machine etc.</li>\r\n</ul>', NULL, 1, '5c9e3ecc258ceDumpling-Machine.jpg', '5c9e3ecc256c45c93f79a5e183Doc1.pdf', 1, 0, '2019-03-29 07:50:36', '2019-03-29 07:50:36'),
(117, NULL, 'ELECTRICAL ROTARY RACK OVEN', 'electrical-rotary-rack-oven', '<p>Rotary Rack Oven for wide baking bread, toast, bun, biscuits, baguette etc.</p>', '<p>These&nbsp;ovens&nbsp;are used in the&nbsp;bakery and confectionery industry owing to the baking system adopted. The baking is carried out by the passage of air, heated by a heat exchanger, through&nbsp;a Multi-layer rack which is loaded with trays, offering the best result for small and large sized bread as well as any other similar products.<br />\r\nThe rack is stand on the Flore of the oven and rotates on its axis by means of electromechanical system placed on the oven ceiling.</p>\r\n\r\n<p>Bread baking machine, toast&nbsp;baking machine, bun&nbsp;baking machine, biscuits&nbsp;baking machine, baguette&nbsp;baking machine etc.</p>', NULL, 1, '5c9f22aae7a0bElectric-Rotary-Rack-Oven.jpg', '5c9f22aae774c5c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 00:02:50', '2019-03-30 00:02:50'),
(118, NULL, 'ENCRUSTING MACHINE', 'encrusting-machine', '<p>Suitable for encrusting / decorating Moon cake, Pineapple cake,&nbsp;Mochi,&nbsp;sun biscuit, pie cake, pillow cake, taro cake, jujube cake, twisted&nbsp;cookie, filled&nbsp;cookies, sesame&nbsp;ball, maamoul, meatballs, fruit&nbsp;pastry,&nbsp;pumpkin pie, crystal Bun, cookie, biscuit, ice&nbsp;cake,&nbsp;rice croquette, piroshki, filled gnocchi etc.</p>', '<ul>\r\n	<li>The encrusting machine is multi-Functional.</li>\r\n	<li>It can be applied to produce mooncake,&nbsp;maamoul, filled cookie, dates bar, mochi, pumpkin pie,&nbsp;fruit pastry,&nbsp;pineapple&nbsp;cake with soft filling.</li>\r\n	<li>The main electric parts are&nbsp;world&nbsp;famous brand.</li>\r\n	<li>The operation system adopts&nbsp;tawian&nbsp;PLC and&nbsp;colour&nbsp;touch screen.</li>\r\n	<li>The speed can be infinitely variable controlled and have memorized function. &nbsp;&nbsp;&nbsp;&nbsp;So it is easy to operate and learn.</li>\r\n	<li>It is high efficiency. But it is only suitable for soft filling, such as fruit paste, jam paste and so on.</li>\r\n	<li>Moon cake encrusting machine, Pineapple cake encrusting machine,&nbsp;Mochi encrusting machine,&nbsp;sun biscuit encrusting machine, pie cake encrusting machine, pillow cake encrusting machine, taro cake encrusting machine, jujube cake encrusting machine, twisted&nbsp;cookie encrusting machine, filled&nbsp;cookies encrusting machine, sesame&nbsp;ball encrusting machine, maamoul encrusting machine, meatballs encrusting machine, fruit&nbsp;pastry encrusting machine,&nbsp;pumpkin pie encrusting machine, crystal Bun encrusting machine, cookie encrusting machine, biscuit encrusting machine, ice&nbsp;cake encrusting machine,&nbsp;rice croquette encrusting machine, piroshky encrusting machine, filled gnocchi encrusting machine.&nbsp;</li>\r\n</ul>', NULL, 1, '5c9f282bd080dEncrusting-Machine.jpg', '5c9f282bd05345c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 00:26:19', '2019-03-30 00:26:19'),
(119, NULL, 'Halwa Making Machine (SAM-AFM-HM', 'halwa-making-machine-sam-afm-hm', '<p>It is useful for baking various types of halwa such as mung halwa, karachi halwa, tirunelveli halwa, bombay halwa, ice halwa, besan halwa, atta halwas and also all types of barfis, mysorepak, mohanthal, kaju bite, jelly, slurry, dal pinni, dodha barfi, mava barfi etc.</p>', '<p>We are dedicatedly engaged in manufacturing and exporting a unique range of halwa making machine (steam) that is widely used in various industries including restaurants, hotels, sweets outlets, bakery and confectionery.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Top to bottom S.S.304 / anodized parts</li>\r\n	<li>Inbuilt high capacity gas burner with flow control</li>\r\n	<li>Machine can be tilted for removing material</li>\r\n	<li>Easy locking mechanism for kadai while tilting</li>\r\n	<li>Huge saving of gas &amp; heat due to extra cover on kadai</li>\r\n	<li>Lifetime no lubricating/greasing require</li>\r\n	<li>Inbuilt ac drive for controlling rotation speed</li>\r\n	<li>Caster mounted for easy movement</li>\r\n</ul>', NULL, 1, '5c9f295903cceHalwa-Making-Machine-(SAM-AFM-HM.png', '5c9f295903b395c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 00:31:21', '2019-03-30 00:31:21'),
(120, NULL, 'Laddu Making Machine', 'laddu-making-machine', '<p>Laddu making machine makes besan, panchdhanya, nagli, dink, gum, churma, rawa, suji, chana dal, kaju, motichur, bundi, allu wada, allu tikka, kachori etc.</p>', '<ul>\r\n	<li>We hold a sound position in manufacturing, exporting and supplying laddu making machine.</li>\r\n	<li>Usage of finest-grade metal and aluminium components&nbsp;</li>\r\n	<li>These machines are highly resistant to corrosion</li>\r\n	<li>Reliability and longer life.</li>\r\n	<li>The table top ergonomically designed machine skillfully, accurately, and at high-speed that produces perfect sizes of round balls whilst retaining the delicate texture of the product.</li>\r\n	<li>Laddu making machine makes besan, panchdhanya, nagli, dink, gum, churma, rawa, suji, chana dal, kaju, motichur, bundi, allu wada, allu tikka, kachori etc.&nbsp;</li>\r\n	<li>The ingredients are skillfully moulded into balls through the Teflon conveyor and gently ejected out whilst retaining &quot;viscosity&quot; and &quot;Elasticity&quot; of the product</li>\r\n	<li>A simple yet very advanced state of the art machine designed to be user-friendly, allowing ease of use, cleaning and assembly.</li>\r\n	<li>Laddu making machine makes besan laddu making machine, panchdhanya&nbsp;&nbsp;laddu making machine, nagli&nbsp;&nbsp;laddu making machine, dink&nbsp;laddu making machine, gum&nbsp;laddu making machine, churma&nbsp;laddu making machine, rawa&nbsp;laddu making machine, suji laddu making machine, chana dal&nbsp;laddu making machine, kaju&nbsp;laddu making machine, motichur&nbsp;&nbsp;laddu making machine, bundi&nbsp;making machine, allu wada&nbsp;making machine, allu tikka making machine, kachori making machine etc.</li>\r\n</ul>', NULL, 1, '5c9f2a1334d17Laddu-Making-Machine.png', '5c9f2a1334b845c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 00:34:27', '2019-03-30 00:34:27'),
(121, NULL, 'Rusgulla & Gulab Jamun Making Machine', 'rusgulla-gulab-jamun-making-machine', '<p>Rasgulla Gulab Jamun making machine is usefull for making various types of sweets like peda, rasgulla, gulabjamun, rasmalai etc.</p>', '<p>Rasgulla Gulab Jamun making machine is usefull for making various types of sweets like peda, rasgulla, gulabjamun, rasmalai etc.</p>', NULL, 1, '5c9f2acf2aaa7Rusgulla-&-Gulab-Jamun-Making-Machine.jpg', '5c9f2acf2a91f5c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 00:37:35', '2019-03-30 00:37:35'),
(122, NULL, 'TWIN COLOR COOKIES', 'twin-color-cookies', '<p>Twin Colors Cookies Making Machine is suitable for making Two colour cookies with different shapes such as flowers shapes, round shapes, star shapes, stick shapes, and much more.</p>\r\n\r\n<p>&nbsp;</p>', '<ul>\r\n	<li>Twin colour cookies machine can make deposited cookies and wire cut cookies.</li>\r\n	<li>It brings you a unique and different flavour.</li>\r\n	<li>Multifunction cookie machine is a kind of shape machine which can produce many kinds of unique designed snacks and cookies</li>\r\n	<li>It squeezes out dough and takes a shape</li>\r\n	<li>Characteristics of modern techniques, compact structure, multifunction, simple operation etc.</li>\r\n	<li>It is one of an ideal new type food machinery deeply welcomed by the masses of users and investors of the market at present as well.</li>\r\n	<li>With many kinds of mounds, this machine can produce dozens of designs a cookie can have.</li>\r\n	<li>The customers can choose according to their need.</li>\r\n	<li>Taking shape design snacks and cookies have unique form and handsome appearance.</li>\r\n	<li>The green body made by this machine can bake through hot air rotary oven or tunnel stove.</li>\r\n</ul>', NULL, 1, '5c9f2bed6eda7Twin-Colors-Cookies-Making-Machine.png', '5c9f2bed6ec305c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 00:42:21', '2019-03-30 00:42:21'),
(123, NULL, 'Biscuit Line / Biscuit Making Machine', 'biscuit-line-biscuit-making-machine', '<p>It can make&nbsp;creamy biscuits, hard biscuits, soft biscuits, Center Jam filling biscuits.</p>\r\n\r\n<p><strong>Shapes:</strong></p>\r\n\r\n<p>Round shape biscuit, square&nbsp;shape biscuit, rectangular&nbsp;shape biscuit, triangle&nbsp;shape biscuit, Oval&nbsp;shape biscuit, Alphabets&nbsp;shape biscuit, star&nbsp;shape biscuit, flower&nbsp;shape biscuit and much more.</p>', '<ul>\r\n	<li>The main raw material is wheat biscuit flour, then add sugar, oil, eggs, dairy products and other accessories.</li>\r\n	<li>Depending on the formulation and production process, the sweet biscuit and cookies can be divided into two categories biscuit.</li>\r\n	<li>Biscuit is characterized by a more concave shape impression flower needle surface.</li>\r\n	<li>Products smooth surface, cross-section structure level, there is a sense of time chewing crunchy, chewy.</li>\r\n	<li><strong>Cookie:</strong>&nbsp;wheat flour, sugar, oil as the main raw material, adding a leavening agent, and other accessories. The cold powder technology blending flour, roll, roll printing or punch, baked into a convex shape, mostly flowers, cross-sectional structure rendered porous tissue a loose texture of baked goods.&nbsp;Such as butter cookies, Congaing crackers, sesame crackers, eggs, biscuit and so on.</li>\r\n	<li><strong>Biscuit:</strong>&nbsp;wheat flour, sugar, oil as the main raw material, adding osteoporosis agents, modifiers and other materials, the heat transfer process powder pink, roll, roll cutting or printing, graphic baking made mostly spend concave appearance smooth, smooth surface, there is needle, section layered, crunchy baked goods. Such as milk cake, vanilla cake, egg flavour cake, pie, Mary, Boston cake.</li>\r\n	<li>A completely new-style biscuit machine, reliable quality, automated production, the production of various kinds of biscuit mould, customized according to your needs. Butter cookies, thin biscuit, oreo biscuit, milk and cookies, animal crackers, vegetable biscuits etc.&nbsp;</li>\r\n	<li>Biscuit&nbsp;production&nbsp;line&nbsp;Combined&nbsp;freely&nbsp;according&nbsp;to&nbsp;the&nbsp;condition&nbsp;of&nbsp;customers&nbsp;workshop&nbsp;space&nbsp;and requirement&nbsp;of&nbsp;biscuit&nbsp;technology.&nbsp;</li>\r\n	<li>This production&nbsp;line uses imported electric components and its speed&nbsp;is changed by frequency conversion.</li>\r\n	<li>They save energy and are dependable and controlled single or combined.</li>\r\n</ul>\r\n\r\n<p><strong>Raw materials:</strong></p>\r\n\r\n<p>Wheat flour, water, milk, sugar, oil etc as ingredients.</p>', NULL, 1, '5c9f2c5fa79bfBiscuit-Line---Biscuit-Making-Machine.png', '5c9f2c5fa782a5c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 00:44:15', '2019-03-30 00:44:15'),
(124, NULL, 'Chopping Machine (DC-M4)', 'chopping-machine-dc-m4', '<p>Thepreservedfruitcubecuttingmachineisspeciallydesignedforcuttingdrieddates, apple, apricot, meat, strawberries, hawthornetcintosmallcubes.</p>', '<ul>\r\n	<li>It&nbsp;is&nbsp;suitable&nbsp;for&nbsp;the&nbsp;high&nbsp;sugar&nbsp;content, sticky&nbsp;knife&nbsp;fruit.</li>\r\n	<li>Such&nbsp;as&nbsp;Apple&nbsp;pulp,&nbsp;apricots,&nbsp;strawberries,&nbsp;pear&nbsp;preserved&nbsp;hawthorn,&nbsp;hippophae&nbsp;rhamnoides,&nbsp;raisins,&nbsp;dried&nbsp;haitang, died&nbsp;date&nbsp;palm,&nbsp;dates, etc.</li>\r\n	<li>It&nbsp;combines with&nbsp;preserved&nbsp;fruit&nbsp;hand-cut&nbsp;way</li>\r\n	<li>Our&nbsp;company&nbsp;has&nbsp;developed&nbsp;a&nbsp;new&nbsp;type&nbsp;of&nbsp;fruit&nbsp;dicing machines,&nbsp;this&nbsp;machine&nbsp;consists&nbsp;of&nbsp;a round shaped knife&nbsp;set&nbsp;and&nbsp;a&nbsp;knife&nbsp;set&nbsp;auger.</li>\r\n	<li>The&nbsp;auger&nbsp;type&nbsp;blade&nbsp;is&nbsp;specially&nbsp;equipped&nbsp;with the machine, which&nbsp;can&nbsp;cut&nbsp;dried&nbsp;fruit&nbsp;effectively.</li>\r\n	<li>The&nbsp;tight&nbsp;structure&nbsp;and&nbsp;careful&nbsp;design&nbsp;can&nbsp;guarantee&nbsp;the&nbsp;quality&nbsp;and&nbsp;performance&nbsp;of the&nbsp;machine&nbsp;for&nbsp;customers&nbsp;completely.</li>\r\n	<li>Just&nbsp;one&nbsp;worker&nbsp;is&nbsp;enough&nbsp;for&nbsp;operating&nbsp;the&nbsp;machine.</li>\r\n	<li>The&nbsp;machine&nbsp;can&nbsp;automatic&nbsp;cut&nbsp;and&nbsp;convey&nbsp;materials&nbsp;steadily</li>\r\n	<li>The&nbsp;unit&nbsp;has a large&nbsp;market&nbsp;around the word.</li>\r\n	<li>Saving&nbsp;energy&nbsp;and&nbsp;labours;</li>\r\n	<li>Easy&nbsp;to&nbsp;operate&nbsp;and&nbsp;maintain.</li>\r\n</ul>', NULL, 1, '5c9f2d8d3d837Chopping-Machine-(DC-M4).png', '5c9f2d8d3d6bd5c93f79a5e183Doc1.pdf', 0, 0, '2019-03-30 00:49:17', '2019-03-30 00:49:17'),
(125, NULL, 'Chopping Machine (DC-M4)', 'chopping-machine-dc-m4', '<p>Thepreservedfruitcubecuttingmachineisspeciallydesignedforcuttingdrieddates, apple, apricot, meat, strawberries, hawthornetcintosmallcubes</p>', '<ul>\r\n	<li>It&nbsp;is&nbsp;suitable&nbsp;for&nbsp;the&nbsp;high&nbsp;sugar&nbsp;content, sticky&nbsp;knife&nbsp;fruit.</li>\r\n	<li>Such&nbsp;as&nbsp;Apple&nbsp;pulp,&nbsp;apricots,&nbsp;strawberries,&nbsp;pear&nbsp;preserved&nbsp;hawthorn,&nbsp;hippophae&nbsp;rhamnoides,&nbsp;raisins,&nbsp;dried&nbsp;haitang, died&nbsp;date&nbsp;palm,&nbsp;dates, etc.</li>\r\n	<li>It&nbsp;combines with&nbsp;preserved&nbsp;fruit&nbsp;hand-cut&nbsp;way</li>\r\n	<li>Our&nbsp;company&nbsp;has&nbsp;developed&nbsp;a&nbsp;new&nbsp;type&nbsp;of&nbsp;fruit&nbsp;dicing machines,&nbsp;this&nbsp;machine&nbsp;consists&nbsp;of&nbsp;a round shaped knife&nbsp;set&nbsp;and&nbsp;a&nbsp;knife&nbsp;set&nbsp;auger.</li>\r\n	<li>The&nbsp;auger&nbsp;type&nbsp;blade&nbsp;is&nbsp;specially&nbsp;equipped&nbsp;with the machine, which&nbsp;can&nbsp;cut&nbsp;dried&nbsp;fruit&nbsp;effectively.</li>\r\n	<li>The&nbsp;tight&nbsp;structure&nbsp;and&nbsp;careful&nbsp;design&nbsp;can&nbsp;guarantee&nbsp;the&nbsp;quality&nbsp;and&nbsp;performance&nbsp;of the&nbsp;machine&nbsp;for&nbsp;customers&nbsp;completely.</li>\r\n	<li>Just&nbsp;one&nbsp;worker&nbsp;is&nbsp;enough&nbsp;for&nbsp;operating&nbsp;the&nbsp;machine.</li>\r\n	<li>The&nbsp;machine&nbsp;can&nbsp;automatic&nbsp;cut&nbsp;and&nbsp;convey&nbsp;materials&nbsp;steadily</li>\r\n	<li>The&nbsp;unit&nbsp;has a large&nbsp;market&nbsp;around the word.</li>\r\n	<li>Saving&nbsp;energy&nbsp;and&nbsp;labours;</li>\r\n	<li>Easy&nbsp;to&nbsp;operate&nbsp;and&nbsp;maintain.</li>\r\n</ul>', NULL, 1, '5c9f2e22f2bb9Chopping-Machine-(DC-M4).png', '5c9f2e22f2a1f5c93f79a5e183Doc1.pdf', 0, 0, '2019-03-30 00:51:46', '2019-03-30 00:51:46'),
(126, NULL, 'Chopping Machine (DC-M4)', 'chopping-machine-dc-m4', '<p>Thepreservedfruitcubecuttingmachineisspeciallydesignedforcuttingdrieddates, apple, apricot, meat, strawberries, hawthornetcintosmallcubes.</p>', '<ul>\r\n	<li>It&nbsp;is&nbsp;suitable&nbsp;for&nbsp;the&nbsp;high&nbsp;sugar&nbsp;content, sticky&nbsp;knife&nbsp;fruit.</li>\r\n	<li>Such&nbsp;as&nbsp;Apple&nbsp;pulp,&nbsp;apricots,&nbsp;strawberries,&nbsp;pear&nbsp;preserved&nbsp;hawthorn,&nbsp;hippophae&nbsp;rhamnoides,&nbsp;raisins,&nbsp;dried&nbsp;haitang, died&nbsp;date&nbsp;palm,&nbsp;dates, etc.</li>\r\n	<li>It&nbsp;combines with&nbsp;preserved&nbsp;fruit&nbsp;hand-cut&nbsp;way</li>\r\n	<li>Our&nbsp;company&nbsp;has&nbsp;developed&nbsp;a&nbsp;new&nbsp;type&nbsp;of&nbsp;fruit&nbsp;dicing machines,&nbsp;this&nbsp;machine&nbsp;consists&nbsp;of&nbsp;a round shaped knife&nbsp;set&nbsp;and&nbsp;a&nbsp;knife&nbsp;set&nbsp;auger.</li>\r\n	<li>The&nbsp;auger&nbsp;type&nbsp;blade&nbsp;is&nbsp;specially&nbsp;equipped&nbsp;with the machine, which&nbsp;can&nbsp;cut&nbsp;dried&nbsp;fruit&nbsp;effectively.</li>\r\n	<li>The&nbsp;tight&nbsp;structure&nbsp;and&nbsp;careful&nbsp;design&nbsp;can&nbsp;guarantee&nbsp;the&nbsp;quality&nbsp;and&nbsp;performance&nbsp;of the&nbsp;machine&nbsp;for&nbsp;customers&nbsp;completely.</li>\r\n	<li>Just&nbsp;one&nbsp;worker&nbsp;is&nbsp;enough&nbsp;for&nbsp;operating&nbsp;the&nbsp;machine.</li>\r\n	<li>The&nbsp;machine&nbsp;can&nbsp;automatic&nbsp;cut&nbsp;and&nbsp;convey&nbsp;materials&nbsp;steadily</li>\r\n	<li>The&nbsp;unit&nbsp;has a large&nbsp;market&nbsp;around the word.</li>\r\n	<li>Saving&nbsp;energy&nbsp;and&nbsp;labours;</li>\r\n	<li>Easy&nbsp;to&nbsp;operate&nbsp;and&nbsp;maintain.</li>\r\n</ul>', 'https://www.youtube.com/watch?v=8FICsFDMlWY', 1, '5c9f39da27b1dChopping-Machine-(DC-M4).png', '5c9f39da238ed5c93f79a5e183Doc1.pdf', 0, 0, '2019-03-30 01:41:46', '2019-03-30 01:41:46'),
(127, 105, 'Chopping Machine (DC-M4)', 'chopping-machine-dc-m4', '<p>The preserved fruit cube cutting machine is specially designed for cutting dried dates, apple, apricot, meat, strawberries, hawthorn, etc into small cubes.</p>', '<ul>\r\n	<li>It&nbsp;is&nbsp;suitable&nbsp;for&nbsp;the&nbsp;high&nbsp;sugar&nbsp;content, sticky&nbsp;knife&nbsp;fruit.</li>\r\n	<li>Such&nbsp;as&nbsp;Apple&nbsp;pulp,&nbsp;apricots,&nbsp;strawberries,&nbsp;pear&nbsp;preserved&nbsp;hawthorn,&nbsp;hippophae&nbsp;rhamnoides,&nbsp;raisins,&nbsp;dried&nbsp;haitang, died&nbsp;date&nbsp;palm,&nbsp;dates, etc.</li>\r\n	<li>It&nbsp;combines with&nbsp;preserved&nbsp;fruit&nbsp;hand-cut&nbsp;way</li>\r\n	<li>Our&nbsp;company&nbsp;has&nbsp;developed&nbsp;a&nbsp;new&nbsp;type&nbsp;of&nbsp;fruit&nbsp;dicing machines,&nbsp;this&nbsp;machine&nbsp;consists&nbsp;of&nbsp;a round shaped knife&nbsp;set&nbsp;and&nbsp;a&nbsp;knife&nbsp;set&nbsp;auger.</li>\r\n	<li>The&nbsp;auger&nbsp;type&nbsp;blade&nbsp;is&nbsp;specially&nbsp;equipped&nbsp;with the machine, which&nbsp;can&nbsp;cut&nbsp;dried&nbsp;fruit&nbsp;effectively.</li>\r\n	<li>The&nbsp;tight&nbsp;structure&nbsp;and&nbsp;careful&nbsp;design&nbsp;can&nbsp;guarantee&nbsp;the&nbsp;quality&nbsp;and&nbsp;performance&nbsp;of the&nbsp;machine&nbsp;for&nbsp;customers&nbsp;completely.</li>\r\n	<li>Just&nbsp;one&nbsp;worker&nbsp;is&nbsp;enough&nbsp;for&nbsp;operating&nbsp;the&nbsp;machine.</li>\r\n	<li>The&nbsp;machine&nbsp;can&nbsp;automatic&nbsp;cut&nbsp;and&nbsp;convey&nbsp;materials&nbsp;steadily</li>\r\n	<li>The&nbsp;unit&nbsp;has a large&nbsp;market&nbsp;around the word.</li>\r\n	<li>Saving&nbsp;energy&nbsp;and&nbsp;labours;</li>\r\n	<li>Easy&nbsp;to&nbsp;operate&nbsp;and&nbsp;maintain.</li>\r\n</ul>', 'https://www.youtube.com/watch?v=8FICsFDMlWY', 1, '5c9f3b6974928Chopping-Machine-(DC-M4).png', '5c9f3b69710225c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 01:48:25', '2019-04-05 21:42:28'),
(128, NULL, 'Deseeding Machine (DD-02)', 'deseeding-machine-dd-02', '<p>It is suitable to pit Dates, Cherry, Plum, Olive, Crabapple.</p>', '<ul>\r\n	<li>The deseeding machine&nbsp;is used for pitting fruits such as dates, plum, olive, etc.&nbsp;</li>\r\n	<li>The dates without pit can be much more convenient to use.</li>\r\n	<li>The most important thing is, after pitting, dates still have high integrity flesh rate.</li>\r\n	<li>This kind of pitting machine adopts high speed sprinting and penetrating theory.</li>\r\n	<li>It uses electromagnetic vibration feeder for automatic feeding for loading material automatically, then sends the fruit to pitting stations by the chain conveyor.</li>\r\n	<li>Under the help of the upper die, the wedge centralizer die can finish automatic axis positioning and clamping.</li>\r\n	<li>Then the punch-pin goes down and punch the fruit pit, subsequently, the upper die goes back and separate the lower die by the elasticity.</li>\r\n	<li>Finally, the fruit pulp was sent to the discharge hole by a chain conveyor.</li>\r\n	<li>The faster the speed of the punch-pin is, the more integrated the fruit will keep.</li>\r\n	<li>Widely suitable for pit Dates, Cherry, Plum, Olive, Crabapple, Hawthorn and so on.</li>\r\n	<li>An adjustable mould according to different materials, with the diameter scope from 10mm to 34mm.</li>\r\n	<li>Frequency conversion technology makes the operation simple and high effective.</li>\r\n	<li>High integrity flesh rate.</li>\r\n</ul>', 'https://www.youtube.com/watch?v=fhgRv30MZ4A', 1, '5c9f4bea747eeDeseeding-Machine-(DD-02).png', '5c9f4bea746755c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 02:58:50', '2019-03-30 02:58:50'),
(129, NULL, 'Dry Fruits Slicing Machine', 'dry-fruits-slicing-machine', '<p>It is used for&nbsp;slicing the dry fruits like almond, cashew, pistachio, etc</p>', '<p>The Sliced Natural Almonds we offer provides nourishment to the skin if consumed regularly. Sliced Almonds are used for making Salads and&nbsp;Baking Cakes, Cookies, etc. Cost-effective prices have been fixed for the Sliced Almonds we export and supply. The company is a note worthy Sliced Almonds...&nbsp;</p>\r\n\r\n<p>Sweet almond is rich in nutritional value, is very famous and precious in the dried fruit market , and can be eaten direct consumption. Sweet almond is easily absorbed, not only beauty, as well as obesity in summer.</p>\r\n\r\n<p>Function and Useage:</p>\r\n\r\n<p>1.&nbsp;Relaxing bowels and control weight.</p>\r\n\r\n<p>2.&nbsp;Promote skin microcirculation to make skin rosy and shiny, have cosmetic results.</p>\r\n\r\n<p>3.&nbsp;Maintaining a healthy heart and lower cholesterol</p>', NULL, 1, '5c9f4d0de86e4Dry-Fruits-Slicing-Machine-(DFS-90).jpg', '5c9f4d0de85635c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 03:03:41', '2019-03-30 03:03:41'),
(130, NULL, 'Multifunction Meat Dicing', 'multifunction-meat-dicing', '<p>It is used for dicing, slicing, pieces, strip and cubing the meat, frozen and fresh meat.</p>', '<ul>\r\n	<li>The machine is the first choice of cutting equipment in food processing industry</li>\r\n	<li>It can cut different meat size by adjusting the thickness control button to make the meat push rod process the pushing speed change.</li>\r\n	<li>With adjusting precompression button, make sure the cutting meat size totally same in the whole machine process</li>\r\n	<li>The meat pushing pole is stepping motion, which can maximum reduce the products squeezing when it uses single blade to cutting</li>\r\n	<li>The size of cutting slot adopts movable side pressure structure, easy to add the products and improve working efficiency.</li>\r\n</ul>', 'https://www.youtube.com/watch?v=avEUTkkdF8Q', 1, '5c9f50678d54eMultifunction-Meat-Dicing.png', '5c9f50678d3ac5c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 03:17:59', '2019-03-30 03:17:59'),
(131, NULL, 'Roasting Machine (RM-38)', 'roasting-machine-rm-38', '<p><strong>Roasting Machine (RM-38)</strong></p>', '<ul>\r\n	<li><strong>Grain beans:&nbsp;</strong>can automatic roasting well on soybeans, coffee beans, cocoa beans, corn, wheat, sorghum, Oats, buckwheat, red beans, mung beans, black beans, peanuts, garbanzo beans, broad beans, rice, millet etc.&nbsp;</li>\r\n	<li><strong>Nuts:</strong>&nbsp;roasting well on peanut, sunflower seed, chestnut, cashew, peanut kernels, pistachio nuts, pecans, cashew nuts, walnuts, pepper, &nbsp;&nbsp;&nbsp;&nbsp;pepper, star anise, cinnamon, cumin, spices, poppy, Chloe, castor, pumpkin seeds, fig .etc take Smokeless roasting and drying to eat.</li>\r\n	<li><strong>Vegetables</strong>: all kinds of vegetable dehydration or tea drying</li>\r\n	<li><strong>Medicinal herbal</strong>: hot air drying or bake roasting</li>\r\n</ul>', 'https://www.youtube.com/watch?v=dsq2ul7Qu80', 1, '5c9f52eada4b0Roasting-Machine-(RM-38).jpg', '5c9f52eada2b25c93f79a5e183Doc1.pdf', 1, 0, '2019-03-30 03:28:42', '2019-03-30 03:28:42'),
(132, NULL, 'Lollipop Processing Line SAMA 500-A', 'lollipop-processing-line-sama-500-a', '<p>It is used for making&nbsp;all types of candies, like soft candy, hard candy etc.</p>', '<ul>\r\n	<li>The processing line is an advanced and continuous plant for making different sizes of flat-type lollipop candies (stick-added by the manual for flat pops), also can make two-colour or striped lollipops, and ball-type lollipop (stick-adding can be done automatically).</li>\r\n	<li>It is an ideal equipment which can produce out good quality products with the saving of both the manpower and the space occupied.&nbsp;</li>\r\n	<li>Hard candy manufacturing machine, soft candy manufacturing machine, candy manufacturing machine.</li>\r\n</ul>', 'https://www.youtube.com/watch?v=imYnenjgpLo', 1, '5c9f54e4ab66bLollipop-Processing-Line-SAMA-500-A.jpg', '5c9f54e4ab4f55c93f79a5e183Doc1.pdf', 0, 0, '2019-03-30 03:37:08', '2019-03-30 03:37:08'),
